        $this->addSql('INSERT INTO `product` (`id`, `sub_category_id`, `title`, `description`, `photo`, `price`, `slug`, `marque`, `color`, `composition`, `dimension`) VALUES
                            (3, 12, \'Acana - Croquettes Regionals Pacifica pour Chat\', \'<p><strong>ACANA Pacifica illustre la richesse marine des eaux froides et pures du Pacifique au Canada. Elle contient des poissons canadiens r&eacute;gionaux frais, des poissons sauvages frais p&ecirc;ch&eacute;s de fa&ccedil;on responsable au nord de l&#39;&Icirc;le de Vancouver.</strong></p>\r\n\r\n<p>D&eacute;bordant de hareng du Pacifique, de sardines, de plie, de merlu et de s&eacute;baste, livr&eacute;s FRAIS et ENTIERS tous les jours.&nbsp;<strong>ACANA Pacifica&nbsp;</strong>offre un r&eacute;gime naturel &agrave; votre chat, sans longue liste d&#39;additifs.</p>\r\n\r\n<p>Partout, nos nourritures ACANA riches en prot&eacute;ines, mais faibles en glucides, inspirent la confiance. ACANA favorise l&#39;excellente condition physique des chats de toutes les races et de tous les &acirc;ges.</p>\r\n\r\n<p><strong>ACANA Regionals :</strong></p>\r\n\r\n<p>Inspir&eacute;es de la r&eacute;gion, les pr&eacute;parations ACANA Regionals regorgent de viandes patrimoniales fra&icirc;ches, de volailles &eacute;lev&eacute;es en libert&eacute; et de poissons sauvages provenant de fermes et des eaux cristallines de l&#39;Ouest canadien. Elles sont riches en prot&eacute;ines, faibles en glucides et pr&eacute;sentent une teneur en viandes de 60 %.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<ul>\r\n	<li>60% de viandes</li>\r\n	<li>Jusqu&#39;&agrave; 50% &eacute;tant fra&icirc;ches</li>\r\n	<li>WholePrey(TM)</li>\r\n	<li>Riche en prot&eacute;ines</li>\r\n	<li>Sans c&eacute;r&eacute;ales</li>\r\n</ul>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Lisez la liste des ingr&eacute;dients et vous les aimerez aussi.</p>\', \'acana-croquettes-regionals-pacifica-pour-chat.jpeg\', 26, \'acana-croquettes-regionals-pacifica-pour-chat\', \'Acana\', \'Bleu\', NULL, NULL),
                            (4, 12, \'Acana - Croquettes Regionals Ranchlands pour Chat\', \'<p><strong>Les vastes ranchs fertiles de l&#39;Alberta sont l&#39;inspiration d&#39;ACANA Ranchlands, riche en ingr&eacute;dients r&eacute;gionaux frais et uniques, y compris les viandes d&#39;animaux &eacute;lev&eacute;s dans des ranchs et des poissons sauvages p&ecirc;ch&eacute;s dans les eaux de l&#39;Ouest du Canada.</strong></p>\r\n\r\n<p><strong>ACANA Ranchlands&nbsp;</strong>regorge de b&oelig;uf Angus, d&#39;agneau nourri &agrave; l&#39;herbe, de porc de race Yorkshire, de bison des plaines et de dor&eacute; jaune sauvage entier, tous frais, livr&eacute;s dans des proportions WholePrey. Saveur et bienfaits en quantit&eacute; assur&eacute;s.</p>\r\n\r\n<p>Partout, nos nourritures ACANA riches en prot&eacute;ines, mais faibles en glucides, inspirent la confiance. ACANA favorise l&#39;excellente condition physique des chats de toutes les races et de tous les &acirc;ges.</p>\r\n\r\n<p><strong>ACANA Regionals :</strong></p>\r\n\r\n<p>Inspir&eacute;es de la r&eacute;gion, les pr&eacute;parations ACANA Regionals regorgent de viandes patrimoniales fra&icirc;ches, de volailles &eacute;lev&eacute;es en libert&eacute; et de poissons sauvages provenant de fermes et des eaux cristallines de l&#39;Ouest canadien. Elles sont riches en prot&eacute;ines, faibles en glucides et pr&eacute;sentent une teneur en viandes de 60 %.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<ul>\r\n	<li>60% de viandes</li>\r\n	<li>Jusqu&#39;&agrave; 50% &eacute;tant fra&icirc;ches</li>\r\n	<li>WholePrey(TM)</li>\r\n	<li>Riche en prot&eacute;ines</li>\r\n	<li>Sans c&eacute;r&eacute;ales</li>\r\n</ul>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Lisez la liste des ingr&eacute;dients et vous les aimerez aussi.</p>\', \'acana-croquettes-regionals-ranchlands-pour-chat.jpeg\', 29, \'acana-croquettes-regionals-ranchlands-pour-chat\', \'Regionals 25\', \'Marron\', NULL, NULL),
                            (5, 12, \'Acana - Croquettes Regionals Wild Prairie pour Chat\', \'<p><strong>Inspir&eacute;e par nos vastes prairies fertiles, nos sols riches et nos lacs aux eaux pures, ACANA Wild Prairie contient des ingr&eacute;dients r&eacute;gionaux uniques, livr&eacute;s frais des fermes et eaux de l&#39;Ouest canadien.</strong></p>\r\n\r\n<p><strong>ACANA Wild Prairie&nbsp;</strong>d&eacute;borde de bienfaits naturels : dinde et poulet &eacute;lev&eacute;s en libert&eacute;, &oelig;ufs entiers pondus au nid et poissons sauvages p&ecirc;ch&eacute;s dans nos lacs du Nord, livr&eacute;s frais tous les jours dans les proportions WholePrey.</p>\r\n\r\n<p>Partout, nos nourritures ACANA riches en prot&eacute;ines, mais faibles en glucides, inspirent la confiance. ACANA favorise l&#39;excellente condition physique des chats de toutes les races et de tous les &acirc;ges.</p>\r\n\r\n<p><strong>ACANA Regionals :</strong></p>\r\n\r\n<p>Inspir&eacute;es de la r&eacute;gion, les pr&eacute;parations ACANA Regionals regorgent de viandes patrimoniales fra&icirc;ches, de volailles &eacute;lev&eacute;es en libert&eacute; et de poissons sauvages provenant de fermes et des eaux cristallines de l&#39;Ouest canadien. Elles sont riches en prot&eacute;ines, faibles en glucides et pr&eacute;sentent une teneur en viandes de 60 %.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<ul>\r\n	<li>60% de viandes</li>\r\n	<li>Jusqu&#39;&agrave; 50% &eacute;tant fra&icirc;ches</li>\r\n	<li>WholePrey(TM)</li>\r\n	<li>Riche en prot&eacute;ines</li>\r\n	<li>Sans c&eacute;r&eacute;ales</li>\r\n</ul>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Lisez la liste des ingr&eacute;dients et vous les aimerez aussi.</p>\', \'acana-croquettes-regionals-wild-prairie-pour-chat.jpeg\', 23, \'acana-croquettes-regionals-wild-prairie-pour-chat\', \'Wild Prairie\', \'jaune\', NULL, NULL),
                            (6, 12, \'Lily  s Kitchen - Barquette Délice de Poulet Bio pour Chats - 85g\', \'<p>Le D&eacute;lice de Poulet Bio pour chats est compos&eacute; d&rsquo;un savoureux m&eacute;lange de poulet, de porc et de b&oelig;uf &eacute;lev&eacute;s en libert&eacute;, mais aussi de poisson. Sa texture agr&eacute;ablement fondante ravira les papilles exigeantes de votre chat.<br />\r\n<br />\r\nPr&eacute;par&eacute; &agrave; partir d&rsquo;ingr&eacute;dients 100 % certifi&eacute;s bio, ce Plat de poulet est compos&eacute; d&rsquo;un savoureux m&eacute;lange de 56 % de poulet, de porc et de b&oelig;uf &eacute;lev&eacute;s en libert&eacute;, mais aussi de poisson. Sa texture agr&eacute;ablement fondante ravira les papilles exigeantes de votre chat.<br />\r\n<br />\r\nSa composition riche en viande et en poisson bio de qualit&eacute; rend cette recette aussi d&eacute;licieuse que nutritionnellement compl&egrave;te et &eacute;quilibr&eacute;e. Elle contient &eacute;galement de la taurine essentielle &agrave; la protection des yeux et du c&oelig;ur, des vitamines et des min&eacute;raux ch&eacute;lat&eacute;s pour une bonne forme physique g&eacute;n&eacute;rale et des om&eacute;gas-3 et 6 pour une peau et un pelage en bonne sant&eacute;. Nous avons aussi ajout&eacute; des carottes pour le go&ucirc;t et de la vitamine A, excellente pour les yeux.<br />\r\n<br />\r\nEn choisissant des aliments biologiques, vous contribuez &agrave; des standards &eacute;lev&eacute;s en mati&egrave;re de bien-&ecirc;tre des animaux, &agrave; une plus grande biodiversit&eacute; et &agrave; des pratiques agricoles holistiques et durables.<br />\r\n&nbsp;</p>\r\n\r\n<ul>\r\n	<li>Riche en bonne viande (des abats et des morceaux de viande fra&icirc;chement d&eacute;coup&eacute;s qui aident les chats &agrave; &ecirc;tre au meilleur de leur forme)</li>\r\n	<li>Le reste se compose d&rsquo;un m&eacute;lange &eacute;quilibr&eacute; d&rsquo;eau pour l&rsquo;hydratation et de vitamines et de min&eacute;raux ch&eacute;lat&eacute;s pour une absorption optimale</li>\r\n	<li>Une alimentation compl&egrave;te et &eacute;quilibr&eacute;e qui contient de la taurine, indispensable &agrave; la sant&eacute; de votre chat</li>\r\n	<li>Une recette 100 % biologique, naturelle et sans c&eacute;r&eacute;ales</li>\r\n	<li>Jamais de farine de viande, de farine d&rsquo;os ou de sous-produits animaux</li>\r\n	<br />\r\n	<li>Fabriqu&eacute; en Union Europ&eacute;enne.</li>\r\n</ul>\', \'lilys-kitchen-barquette-delice-de-poulet-bio-pour-chats-85g.jpeg\', 2, \'lilys-kitchen-barquette-delice-de-poulet-bio-pour-chats-85g\', \'Lily  s Kitchen\', \'Argenté\', NULL, NULL),
                            (7, 12, \'Vigor & Sage - Croquettes Agneau et Fleur de Lotus pour Chat Stérilisé - 2Kg\', \'<p>Croquettes sans c&eacute;r&eacute;ale &agrave; la viande fra&icirc;che et aux herbes rares. L&rsquo;agneau est riche en prot&eacute;ines, stimule le d&eacute;veloppement des muscles et aide &agrave; avoir des os sains. La feuille de lotus favorise le contr&ocirc;le du poids en absorbant les hydrates de carbone et la graisse, les transformant en &eacute;nergie. Elle regorge d&rsquo;antioxydants qui favorisent la circulation sanguine et diminuent la pression sanguine.</p>\r\n\r\n<p><strong>Caract&eacute;ristiques des croquettes Lotus Leaf Weight Control Sterilized &agrave; l&#39;agneau et &agrave; la fleur de lotus :</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<ul>\r\n	<li>0% de prot&eacute;ines de c&eacute;r&eacute;ales</li>\r\n	<li>80% de prot&eacute;ines de viande d&#39;agneau</li>\r\n	<li>20% de prot&eacute;ines de fruits et l&eacute;gumes</li>\r\n	<li>Sans colorant artificiel</li>\r\n	<li>Sans ar&ocirc;me artificiel</li>\r\n	<li>Sans conservateur</li>\r\n	<li>Sans antibiotique</li>\r\n	<li>Sans hormone de croissance</li>\r\n</ul>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Sensibilit&eacute; faible :</strong></p>\r\n\r\n<p>La sensibilit&eacute; alimentaire est tr&egrave;s habituelle chez les animaux. Les sympt&ocirc;mes les plus fr&eacute;quents sont les probl&egrave;mes de peau (d&eacute;mangeaisons et perte du poil), les vomissements et/ou la diarrh&eacute;e. Tous les produits&nbsp;<strong>VIGOR &amp; SAGE</strong>&nbsp;sont sp&eacute;cialement compos&eacute;s pour minimiser les risques de sensibilit&eacute; alimentaire et aident vos animaux &agrave; profiter d&rsquo;une longue et heureuse vie.</p>\', \'vigor-sage-croquettes-agneau-et-fleur-de-lotus-pour-chat-sterilise-2kg.jpeg\', 25, \'vigor-sage-croquettes-agneau-et-fleur-de-lotus-pour-chat-sterilise-2kg\', \'Vigor & Sage\', \'blanc\', NULL, NULL),
                            (8, 12, \'Animalis - Bouchées en Gelée aux Poissons pour Chat Stérilisé - 12x100g\', \'<p>Les sachets fraicheur Animalis offrent &agrave; votre chat adulte st&eacute;rilis&eacute; une alimentation compl&egrave;te sans colorant ni ar&ocirc;me artificiel, sous forme de petites bouch&eacute;es en gel&eacute;e au poisson blanc, &agrave; la crevette ou au saumon. Cette alimentation de haute qualit&eacute; contribue &agrave; maintenir le poids de forme de votre chat st&eacute;rilis&eacute; et pr&eacute;serve le bon fonctionnement de son syst&egrave;me urinaire.</p>\r\n\r\n<p><strong>Contient :</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<ul>\r\n	<li>4 x Poisson Blanc</li>\r\n	<li>4 x Crevette</li>\r\n	<li>4 x Saumon</li>\r\n</ul>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Contribue au fonctionnement du syst&egrave;me urinaire et favorise la sant&eacute; de la peau et la beaut&eacute; du pelage.</p>\', \'animalis-bouchees-en-gelee-aux-poissons-pour-chat-sterilise-12x100g.jpeg\', 6, \'animalis-bouchees-en-gelee-aux-poissons-pour-chat-sterilise-12x100g\', \'Les sachets fraicheurs\', \'violet\', NULL, NULL),
                            (9, 12, \'Lily  s Kitchen - Multipack Repas Favourites pour Chats - 6x85g\', \'<p><strong>Stew pour chats Suppurrs de Lily&rsquo;s Kitchen : notre s&eacute;lection gourmande (6 x 85 g)</strong></p>\r\n\r\n<p>Faites plaisir &agrave; votre chat avec cette s&eacute;lection sp&eacute;ciale de nos trois meilleures recettes Suppurrs&hellip; Une collection simplement irr&eacute;sistible, emball&eacute;e dans un joli pack de 6. Votre boule de poils va adorer ces succulents &lsquo;Stew&rsquo;, pr&eacute;par&eacute;s &agrave; base de filets de poulet de haute qualit&eacute; cuits &agrave; la vapeur douce et effiloch&eacute;s. Riches en abats et vrais morceaux de viande fra&icirc;che, ils offrent un repas nutritionnellement complet et parfaitement &eacute;quilibr&eacute;, qui contient tous les nutriments essentiels &agrave; la sant&eacute; de votre chat.</p>\r\n\r\n<p>Nos recettes exceptionnelles Suppurrs sont naturellement saines et tr&egrave;s, tr&egrave;s all&eacute;chantes&hellip; Vous n&rsquo;avez plus qu&rsquo;&agrave; attendre les ronronnements de plaisir !</p>\r\n\r\n<p><strong>CARACT&Eacute;RISTIQUES :</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<ul>\r\n	<li>Filets de poulet cuits &agrave; la vapeur douce effiloch&eacute;s &agrave; la main</li>\r\n	<li>Au moins 48 % d&rsquo;abats et de vrais morceaux de viande fra&icirc;che qui aident les chats &agrave; &ecirc;tre au meilleur de leur forme</li>\r\n	<li>Le reste se compose d&rsquo;un m&eacute;lange parfaitement &eacute;quilibr&eacute; : de l&rsquo;eau pour l&rsquo;hydratation, des vitamines et des min&eacute;raux ch&eacute;lat&eacute;s tr&egrave;s faciles &agrave; absorber</li>\r\n	<li>Une alimentation compl&egrave;te et &eacute;quilibr&eacute;e qui contient de la taurine, indispensable &agrave; la sant&eacute; de votre chat</li>\r\n	<li>100 % naturel avec des vitamines et min&eacute;raux ajout&eacute;s</li>\r\n	<li>Recettes sans c&eacute;r&eacute;ales</li>\r\n	<li>Uniquement des vrais morceaux de viande : pas de farine animale, de farine d&rsquo;os ni de sous-produits animaux, jamais</li>\r\n	<li>Viande et produit de l&rsquo;Union Europ&eacute;enne</li>\r\n</ul>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>En servant &agrave; votre chat ces repas naturels, vous prenez &eacute;galement soin du monde dans lequel il vit. Nous utilisons des ingr&eacute;dients issus de sources responsables et nos r&eacute;cipients en aluminium sont enti&egrave;rement recyclables.</p>\r\n\r\n<p><strong>Notre s&eacute;lection gourmande de six recettes Suppurrs pour chat contient :</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<ul>\r\n	<li>2 x 85 g : Poulet</li>\r\n	<li>2 x 85 g : B&oelig;uf et Poulet Fermier</li>\r\n	<li>2 x 85 g : D&eacute;lice de Poulet et Saumon</li>\r\n</ul>\', \'lilys-kitchen-multipack-repas-favourites-pour-chats-6x85g.jpeg\', 12, \'lilys-kitchen-multipack-repas-favourites-pour-chats-6x85g\', \'Lily  s Kitchen Suppurrs\', \'Rose\', NULL, NULL),
                            (10, 12, \'Best for your Friend - Bouchées au Poulet Naturel pour Chat - 50g\', \'<p><strong>Best for your Friend</strong>&nbsp;c&#39;est des aliments 100% naturel, innovants et responsables pour votre petit animal de compagnie. Retrouvez toute la gamme d&#39;alimentation pour votre chien ou votre chat sur notre site !</p>\r\n\r\n<ul>\r\n	<li>D&eacute;s de poulet</li>\r\n	<li>Collation d&eacute;licieuse pour les chats</li>\r\n	<li>Riche en prot&eacute;ines</li>\r\n	<li>Faible en graisses</li>\r\n	<li>Digestion facile</li>\r\n	<li>Sans additifs artificiels</li>\r\n	<li>Avec fermeture &agrave; pression</li>\r\n</ul>\r\n\r\n<p><strong>Poids net :</strong>&nbsp;50 grammes.</p>\', \'best-for-your-friend-bouchees-au-poulet-naturel-pour-chat-50g.jpeg\', 2, \'best-for-your-friend-bouchees-au-poulet-naturel-pour-chat-50g\', \'Kiphapjes Bouchees au Poulet\', \'Noir\', NULL, NULL),
                            (11, 12, \'Purina One - Croquettes au Poulet et Blé pour Chat Stérilisé - 6Kg\', \'<p>PURINA ONE Sp&eacute;cial Chat St&eacute;rilis&eacute; est sp&eacute;cifiquement formul&eacute; avec un profil nutritionnel adapt&eacute; aux chats castr&eacute;s ou st&eacute;rilis&eacute;s.<br />\r\n<br />\r\n<strong>PURINA ONE BIFENSIS&reg;</strong>&nbsp;est une formule unique, contenant des bact&eacute;ries fonctionnelles b&eacute;n&eacute;fiques, scientifiquement prouv&eacute;e pour aider &agrave; renforcer les d&eacute;fenses naturelles de votre chat.<br />\r\n<br />\r\nD&eacute;velopp&eacute;e par les v&eacute;t&eacute;rinaires et les nutritionnistes PURINA,&nbsp;<strong>PURINA ONE BIFENSIS&reg;</strong>&nbsp;contient, en plus des bact&eacute;ries fonctionnelles b&eacute;n&eacute;fiques, tous les nutriments essentiels dont votre chat a besoin, tels que des acides gras Om&eacute;ga 6. Cette formule double d&eacute;fense contribue &agrave; la fois, &agrave; l&rsquo;int&eacute;rieur, &agrave; soutenir la production naturelle d&rsquo;anticorps de votre chat et, &agrave; l&rsquo;ext&eacute;rieur, &agrave; maintenir sa peau saine et son pelage brillant.<br />\r\n<br />\r\nDisponible dans une large gamme de recettes d&rsquo;une grande saveur et &eacute;labor&eacute; avec des ingr&eacute;dients de haute qualit&eacute;, dont du saumon comme ingr&eacute;dient N&deg;1,&nbsp;<strong>PURINA ONE BIFENSIS&reg;</strong>&nbsp;aide &agrave; soutenir les d&eacute;fenses naturelles de votre chat aujourd&rsquo;hui et demain.<br />\r\n<br />\r\nSans colorants, ni ar&ocirc;mes et conservateurs artificiels ajout&eacute;s.&nbsp;<br />\r\n<br />\r\n<strong>PURINA ONE Sp&eacute;cial Chat St&eacute;rilis&eacute; est sp&eacute;cifiquement formul&eacute; avec un profil nutritionnel adapt&eacute; aux chats castr&eacute;s ou st&eacute;rilis&eacute;s</strong><br />\r\n&nbsp;</p>\r\n\r\n<ul>\r\n	<li>Formul&eacute; pour aider &agrave; maintenir un m&eacute;tabolisme sain apr&egrave;s la st&eacute;rilisation/castration</li>\r\n	<li>Contr&ocirc;le du poids gr&acirc;ce &agrave; un ratio prot&eacute;ine/mati&egrave;res grasses plus &eacute;lev&eacute; (+15 % par rapport &agrave; la recette Adulte), en suivant les quantit&eacute;s journali&egrave;res recommand&eacute;es sur l&#39;emballage</li>\r\n	<li>Aide &agrave; maintenir un syst&egrave;me urinaire sain gr&acirc;ce &agrave; un taux &eacute;quilibr&eacute; en min&eacute;raux</li>\r\n</ul>\', \'purina-one-croquettes-au-poulet-et-ble-pour-chat-sterilise-6kg.jpeg\', 27, \'purina-one-croquettes-au-poulet-et-ble-pour-chat-sterilise-6kg\', \'Purina One\', \'bleu_ciel\', NULL, NULL),
                            (12, 12, \'Gourmet - Sachets Perle Les Filettines avec Viandes et Poissons pour Chat - 12x85g\', \'<p>R&eacute;servez des mets de choix &agrave; votre majestueux petit f&eacute;lin. Particuli&egrave;rement attentifs aux d&eacute;tails, les cuisiniers Gourmet ont &eacute;labor&eacute; pour votre chat le meilleur avec ces mini filets de viande et poisson. Issu de produits de qualit&eacute;, ce coffret diversifie saveurs et textures dans une combinaison parfaite d&#39;ingr&eacute;dients tri&eacute;s sur le volet et de recettes imaginatives pour un plaisir culinaire &agrave; se l&eacute;cher les babines.</p>\', \'gourmet-sachets-perle-les-filettines-avec-viandes-et-poissons-pour-chat-12x85g.jpeg\', 8, \'gourmet-sachets-perle-les-filettines-avec-viandes-et-poissons-pour-chat-12x85g\', \'Gourmet\', \'Bleu-Blanc\', NULL, NULL),
                            (13, 13, \'Kerbl - Hamac Siesta 2.0 pour Chats - Marron\', \'<p>&bull; ch&acirc;ssis en bois naturel&nbsp;<br />\r\n&bull; matelas en lin&nbsp;<br />\r\n&bull; surface de couchage fixe&nbsp;<br />\r\n&bull; dimensions : 61 x 37 x 29 cm<br />\r\n&bull; montage facile</p>\', \'kerbl-hamac-siesta-2-0-pour-chats-marron.jpeg\', 20, \'kerbl-hamac-siesta-2-0-pour-chats-marron\', \'Kerbl\', \'beige\', NULL, NULL),
                            (15, 13, \'Kerbl - Couchette Alice pour Chats - 58cm\', \'<p>&bull; coussin amovible gr&acirc;ce &agrave; une fermeture velcro<br />\r\n&bull; housse en peluche douce et moelleuse<br />\r\n&bull; dos en tissu oxford robuste<br />\r\n&bull; hauteur 35 cm&nbsp;<br />\r\n&bull; 100 % polyester<br />\r\n&bull; lavable &agrave; 30 &deg;c</p>\', \'kerbl-couchette-alice-pour-chats-58cm.jpeg\', 33, \'kerbl-couchette-alice-pour-chats-58cm\', \'Kerbl_couchette\', \'gris\', NULL, NULL),
                            (16, 13, \'Animalis - Sac de Voyage Bleu pour Chat et Chien - M\', \'<p>Partez en voyage en offrant un v&eacute;ritable confort &agrave; votre petit compagnon gr&acirc;ce &agrave; ce sac de transport. &Eacute;tudi&eacute; comme un cocon, votre animal de compagnie retrouvera un int&eacute;rieur douillet, rembourr&eacute; avec une fen&ecirc;tre d&#39;a&eacute;ration permettant de garder votre animal en s&eacute;curit&eacute; tout en permettant sa curiosit&eacute;. Le sac poss&egrave;de une bandouli&egrave;re r&eacute;glable qui facilitera vos d&eacute;placements. Ce sac est parfait pour un chat ou un chien de petite taille.</p>\r\n\r\n<p><strong>Tailles du sac de voyage Animalis :</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<ul>\r\n	<li>M : 35x25x25 centim&egrave;tres</li>\r\n	<li>L : 42x32x32 centim&egrave;tres</li>\r\n</ul>\', \'animalis-sac-de-voyage-bleu-pour-chat-et-chien-m.jpeg\', 30, \'animalis-sac-de-voyage-bleu-pour-chat-et-chien-m\', \'Kerbl_sac\', \'gris-bleu\', NULL, NULL),
                            (17, 13, \'Animalis - Donut Bleu pour Chat - L\', \'<p>Gamme de couchage pour chat de la marque Animalis. Offrez-lui tout le confort pour son plus grand plaisir !</p>\r\n\r\n<p><strong>Tailles :</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<ul>\r\n	<li>M : 68x68x20 centim&egrave;tres</li>\r\n	<li>L : 81x81x20 centim&egrave;tres</li>\r\n</ul>\', \'animalis-donut-bleu-pour-chat-l.jpeg\', 40, \'animalis-donut-bleu-pour-chat-l\', \'Kerbl_donut\', \'bleu-clair\', NULL, NULL),
                            (18, 13, \'Animalis - Sac de Transport Bulle pour Chat - S\', \'<p>Ce sac de transport Bulle de la marque&nbsp;<strong>Animalis</strong>&nbsp;permet de transporter votre chat ou votre petit chien en toute s&eacute;curit&eacute; ! Ce sac est parfait pour r&eacute;pondre &agrave; toutes les situations qui peuvent se pr&eacute;senter lorsqu&#39;il s&#39;agit de transporter votre animal. Peut &eacute;galement &ecirc;tre utiliser comme sac &agrave; dos classique, les sangles sont rembourr&eacute;es pour les &eacute;paules. L&#39;ouverture est facilit&eacute; par la fermeture &eacute;clair sur le dessus, les bretelles sont &eacute;galement confortables et souples et l&#39;animal pourra tout voir et appr&eacute;cier son voyage gr&acirc;ce &agrave; la bulle d&#39;observation.</p>\r\n\r\n<p>&Agrave; pied, dans le train, en voiture ou pour aller chez le v&eacute;t&eacute;rinaire, quel que soit le trajet, ce sac de transport est parfait pour garantir un confort optimal ainsi que de la s&eacute;curit&eacute; lors du voyage.</p>\r\n\r\n<p><strong>Tailles des sacs Bulle de la marque Animalis :</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<ul>\r\n	<li>S : 39x35x41 centim&egrave;tres</li>\r\n	<li>M : 35x25x45 centim&egrave;tres</li>\r\n	<li>L : 48x26x29 centim&egrave;tres</li>\r\n</ul>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Caract&eacute;ristiques :</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<ul>\r\n	<li>Dimensions de ce sac : 39x35x41 centim&egrave;tres</li>\r\n	<li>Couleur : orange et noir</li>\r\n	<li>Convient pour les chats et les petits chiens</li>\r\n</ul>\', \'animalis-sac-de-transport-bulle-pour-chat-s.jpeg\', 59, \'animalis-sac-de-transport-bulle-pour-chat-s\', \'Kerbl_sac_transport\', \'orange-noir\', NULL, NULL),
                            (19, 13, \'Zolux - Panier de Transport Gulliver 1 pour Chiens et Chats - Gris\', \'<p>Pour des voyages s&eacute;curis&eacute;s ! Hygi&eacute;nique : panier en plastique facilement lavable. S&eacute;curis&eacute; : porte plastique verrouillable. Pour les chiens de 5 Kg environ.</p>\', \'zolux-panier-de-transport-gulliver-1-pour-chiens-et-chats-gris.jpeg\', 17, \'zolux-panier-de-transport-gulliver-1-pour-chiens-et-chats-gris\', \'Zolux\', \'noir-gris\', NULL, NULL),
                            (20, 13, \'Anka - Hamac de Fenêtre pour Chats\', \'<p>Hamac de fen&ecirc;tre pour chat ou chaton fix&eacute; par ventouses. Plateforme d&#39;observation pour &eacute;veiller la curiosit&eacute; de votre chat !<br />\r\n<br />\r\n<strong>Caract&eacute;ristiques du Hamac pour chats :</strong></p>\r\n\r\n<ul>\r\n	<li>R&eacute;siste jusqu&#39;&agrave; 14 kilos</li>\r\n	<li>Convient aux fen&ecirc;tres, portes coulissantes et baies vitr&eacute;es</li>\r\n	<li>Housse de hamac en polyester lavable en machine</li>\r\n	<li>Ne pas positionner sous un radiateur (ventouses se d&eacute;tachent avec la chaleur)</li>\r\n	<li>Dimensions : Longueur 54 centim&egrave;tres x largeur 34 centim&egrave;tres</li>\r\n</ul>\', \'anka-hamac-de-fenetre-pour-chats.jpeg\', 18, \'anka-hamac-de-fenetre-pour-chats\', \'Anka\', \'gris-clair\', NULL, NULL),
                            (21, 13, \'Sac de Transport Urban pour Chat\', \'<p>Sac de transport pour petit et moyen chien et &eacute;galement pour les chats avec fen&ecirc;tres d&#39;a&eacute;ration avant et arri&egrave;re. Ce sac de transport Urban est disponible en noir et en gris, le coloris est al&eacute;atoire lors de l&#39;exp&eacute;dition. Il est pourvu d&#39;une sangle qui permet de le porter en bandouli&egrave;re.</p>\r\n\r\n<p><strong>Dimensions int&eacute;rieures du sac de transport pour petit chien et chat :</strong>&nbsp;47x24x24 centim&egrave;tres.</p>\', \'sac-de-transport-urban-pour-chat.jpeg\', 26, \'sac-de-transport-urban-pour-chat\', \'Urban\', \'gris-foncé\', NULL, NULL),
                            (22, 13, \'Zolux - Dôme Louna pour Chat - Gris\', \'<p><strong>Nouveau d&ocirc;me pour chat au design moderne et au style &eacute;pur&eacute;.</strong></p>\r\n\r\n<p>Confortable, il est dot&eacute; d&#39;un coussin moelleux en fourrure toute douce. Amovible, ce coussin est lavable en machine &agrave; 30&deg;. Il s&#39;assemble facilement et rapidement gr&acirc;ce &agrave; son zip qui lui permet d&#39;&ecirc;tre stock&eacute; et transport&eacute; ais&eacute;ment.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<ul>\r\n	<li>Peut &eacute;galement servir de corbeille</li>\r\n	<li>Coloris : Gris</li>\r\n	<li>Dimensions : 47,5x48,5x31 centim&egrave;tres</li>\r\n</ul>\', \'zolux-dome-louna-pour-chat-gris.jpeg\', 42, \'zolux-dome-louna-pour-chat-gris\', \'Zolux-dome\', \'gris-claire\', NULL, NULL),
                            (23, 13, \'Ferplast - Panier de Transport pour Chat et Chien de Petite Taille - Atlas 10 Vision\', \'<p>D&eacute;sormais vous pourrez emmener votre animal de compagnie partout avec vous gr&acirc;ce &agrave; ce panier de transport, sp&eacute;cialement adapt&eacute; aux chats et chiens de petite taille. Installez confortablement, il pourra vous accompagner lors d&#39;un rendez-vous ou de s&eacute;ances de shopping sans aucun probl&egrave;me. Vendu avec gamelle et tapis pour plus de praticit&eacute;.</p>\', \'ferplast-panier-de-transport-pour-chat-et-chien-de-petite-taille-atlas-10-vision.jpeg\', 38, \'ferplast-panier-de-transport-pour-chat-et-chien-de-petite-taille-atlas-10-vision\', \'Ferplast\', \'Rouge-Blanc\', NULL, NULL),
                            (24, 14, \'Animalis - Arbre à Chat Cube - Gris\', \'<p>Arbre &agrave; chat avec deux plateaux et cube t&ecirc;te de chat avec poteaux en sisal et pompon de jeu.</p>\r\n\r\n<p>Couleur : Gris.</p>\r\n\r\n<p><strong>Dimensions : 49x33x39 centim&egrave;tres.</strong></p>\', \'animalis-arbre-a-chat-cube-gris.jpeg\', 50, \'animalis-arbre-a-chat-cube-gris\', \'Kerbl_arbre\', \'gris-clair1\', NULL, NULL),
                            (25, 14, \'Animalis - Arbre à Chat Poteau M - Noir\', \'<p>La nouvelle gamme d&#39;arbre &agrave; chat&nbsp;<strong>Animalis</strong>&nbsp;s&#39;int&egrave;gre parfaitement dans tous les styles d&#39;int&eacute;rieur gr&acirc;ce &agrave; sa conception moderne et sobre. Ces arbres &agrave; chat sont disponibles sous diff&eacute;rentes couleurs ainsi que sous plusieurs mod&egrave;les de toutes tailles, pour s&#39;adapter au mieux &agrave; votre int&eacute;rieur !</p>\r\n\r\n<p>Offrez &agrave; votre chat des heures de jeu avec cet arbre &agrave; chat ! Il stimule son activit&eacute; et est id&eacute;al pour sa croissance.</p>\r\n\r\n<p><strong>Caract&eacute;ristiques :</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<ul>\r\n	<li>Arbre &agrave; chat socle + tube</li>\r\n	<li>Diam&egrave;tre du tube : &Oslash;8cm</li>\r\n	<li>100% Polyester</li>\r\n	<li>Coloris : Noir</li>\r\n</ul>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Dimensions : 35x35x64 centim&egrave;tres.</strong></p>\', \'animalis-arbre-a-chat-poteau-m-noir.jpeg\', 13, \'animalis-arbre-a-chat-poteau-m-noir\', \'Kerbl_poteau\', \'beige-noir\', NULL, NULL),
                            (26, 14, \'Griffoir pour Chat Gruyère - 30x16x15cm\', \'<p>Griffoir chat pas cher en carton alv&eacute;ol&eacute; avec herbe &agrave; chat.<br />\r\nParfait pour l&#39;hygi&egrave;ne et l&#39;entretien des griffes de votre compagnon.<br />\r\nN&eacute;cessaire &agrave; son &eacute;quilibre, ce griffoir est pr&ecirc;t &agrave; l&#39;emploi et lui permettra de s&#39;allonger et d&#39;&eacute;tirer sa colonne vert&eacute;brale.<br />\r\nUne attraction maximale gr&acirc;ce &agrave; l&#39;herbe &agrave; chat.<br />\r\nTr&egrave;s r&eacute;sistant car fabriqu&eacute; &agrave; partir d&#39;un carton ondul&eacute; et compact&eacute;.<br />\r\nVotre chat pr&eacute;f&egrave;rera naturellement ce griffoir aux meubles pour faire ses griffes.<br />\r\n<br />\r\nConvient &agrave; tout type de chat ou chaton.</p>\', \'griffoir-pour-chat-gruyere-30x16x15cm.jpeg\', 11, \'griffoir-pour-chat-gruyere-30x16x15cm\', \'Anka\', \'jaune\', NULL, NULL),
                            (27, 14, \'Animalis - Arbre à Chat Cube - Gris\', \'<p>L&#39;arbre &agrave; chat Animalis poss&egrave;de un style &agrave; la fois simple et efficace ! Il r&eacute;pondra aux besoins de votre chat tout en restant discret dans votre int&eacute;rieur avec son design sobre. L&#39;arbre &agrave; chat Animalis poss&egrave;de ainsi une plateforme pour que votre chat aventurier puisse y grimper. Son poteau recouvert de sisal se transformera &eacute;galement en griffoir pour son plus grand plaisir ! La niche en forme de cube permet &eacute;galement &agrave; votre chat de s&#39;abriter et jouer &agrave; l&#39;int&eacute;rieur.</p>\r\n\r\n<p><strong>Caract&eacute;ristiques de l&#39;arbre &agrave; chat Animalis :</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<ul>\r\n	<li>Dimensions du cube : 30x30x20 centim&egrave;tres</li>\r\n	<li>Dimensions du poteau : &Oslash;5 - 30 centim&egrave;tres de hauteur</li>\r\n	<li>Dimensions du plateau : 25x25x2 centim&egrave;tres</li>\r\n	<li>Mati&egrave;re : Polyester, sisal et bois</li>\r\n	<li>Notice de montage incluse</li>\r\n	<li>Coloris : Beige</li>\r\n</ul>\', \'animalis-arbre-a-chat-cube-gris.jpeg\', 18, \'animalis-arbre-a-chat-cube-gris\', \'Anka\', \'gris\', NULL, NULL),
                            (28, 8, \'Wouapy - Sac de Transport Camping pour Chiens\', \'<p>Sac Camping sp&eacute;cialement con&ccedil;u pour le confort des chiens, lorsqu&#39;il est d&eacute;pli&eacute;, il offre un large espace s&eacute;curis&eacute;. Le sac Camping avec bandes r&eacute;fl&eacute;chissantes est id&eacute;al pour transporter votre animal. Un astucieux syst&egrave;me d&#39;extension sur les c&ocirc;t&eacute;s, permet &agrave; ce sac de pratiquement tripler sa surface, permettant &agrave; votre animal un gain de place suppl&eacute;mentaire. Compatible avec les animaux de moins de 7 kilos.<br />\r\n<br />\r\nIl est adapt&eacute; pour les chats, petits chiens et autres petits animaux. Con&ccedil;u avec une laisse courte pour garder votre animal &agrave; l&#39;int&eacute;rieur, m&ecirc;me si votre sac est ouvert.</p>\', \'wouapy-sac-de-transport-camping-pour-chiens.jpeg\', 60, \'wouapy-sac-de-transport-camping-pour-chiens\', \'Wouapy\', \'Noir\', \'Nylon\', \'45x25x28 cm\'),
                            (29, 8, \'Trixie - Couverture de Protection pour Sièges de Voiture\', \'<p>Couverture pour si&egrave;ges de voiture</p>\', \'trixie-couverture-de-protection-pour-sieges-de-voiture.jpeg\', 30, \'trixie-couverture-de-protection-pour-sieges-de-voiture\', \'Trixie\', \'Beige\', \'Tissu\', \'10x26x20 cm\'),
                            (30, 8, \'Savic - Panier de Transport Trotter 1 pour Chat et Petit Chien\', \'<p>Trotter 1 est un trotter moderne, recommand&eacute; pour les chats et les petits chiens pesant jusqu&#39;&agrave; 5 kilos. Le panier de transport Trotter 1 est muni d&#39;une porte avant m&eacute;tallique recouvertes de fils m&eacute;talliques. La poign&eacute;e vous permet de transporter votre animal avec vous tr&egrave;s simplement et est recommand&eacute; &eacute;galement pour le voyage en voiture, train ou avion. Les fentes d&#39;a&eacute;ration du Trotter 1 permettent la circulation de l&#39;air pour un maximum de confort.<br />\r\n<br />\r\nLe panier de transport Trotter 1 r&eacute;pond aux normes IATA.</p>\', \'savic-panier-de-transport-trotter-1-pour-chat-et-petit-chien.jpeg\', 19, \'savic-panier-de-transport-trotter-1-pour-chat-et-petit-chien\', \'Savic\', \'Gris, Bleu\', NULL, NULL),
                            (31, 8, \'Rotho MyPet - Cage de Transport Pliable pour Chien\', \'<p>La gamme Mypet offre de haute qualit&eacute;, unique et produits innovants pour les animaux de compagnie. Mypet offre en tant que distributeur Rotho pour les d&eacute;taillants pour animaux de compagnie de panier de nourriture pour animaux, les bols de nourriture et d&#39;accessoires dans une vari&eacute;t&eacute; de tailles et de couleurs. Cette caisse de transport Rotho rend le transport de votre animal tellement plus facile ! En effet, celle-ci est pliable afin d&#39;&eacute;conomiser un maximum d&#39;espace pour la ranger lorsqu&#39;elle n&#39;est pas utilis&eacute;e.</p>\r\n\r\n<p>Prenez-la avec vous dans votre voiture lorsque vous soutaitez promener votre animal ou alors glisser la sous une armoire. Convient pour les animaux jusqu&#39;&agrave; 10 kilos.</p>\', \'rotho-mypet-cage-de-transport-pliable-pour-chien.jpeg\', 25, \'rotho-mypet-cage-de-transport-pliable-pour-chien\', \'Rotho MyPet\', \'Cappuccino\', \'Polypropylène\', \'53,4x42,5x12x4 cm\'),
                            (32, 8, \'Pet on Wheels - Top Case de Transport Universel pour Chien et Chat\', \'<p>Le Pet on Wheels (ou POW) est le premier panier de transport universel pour scooter, v&eacute;lo et m&ecirc;me moto ! Il vous permet de pouvoir transporter votre chien ou votre chat (de 10 kilos maximum) en toute s&eacute;curit&eacute; et avec un maximum de confort, en &eacute;liminant les distractions pour le conducteur. Il s&rsquo;adaptera sur n&rsquo;importe quel porte bagage gr&acirc;ce &agrave; sa plaque de fixation universelle. &Eacute;quip&eacute; de ventilations et d&rsquo;un hublot refermable, le POW permet &agrave; l&rsquo;animal de sortir sa t&ecirc;te en toute s&eacute;curit&eacute;. De plus, il vous est possible de fixer le collier &agrave; l&rsquo;int&eacute;rieur du POW pendant le voyage.<br />\r\n<br />\r\nLe POW-box a &eacute;t&eacute; con&ccedil;u pour les scooters, mais peut aussi &ecirc;tre utilis&eacute; facilement sur la moto &agrave; l&#39;aide de la plaque de montage fournie. Dans une voiture, il n&#39;est pas n&eacute;cessaire d&#39;installer la plaque de montage : il suffit de placer POW sur le si&egrave;ge, faire passer la ceinture de s&eacute;curit&eacute; &agrave; travers la poign&eacute;e et c&#39;est tout. Quand vous ne transporter pas votre petit compagnon, le POW peut vous permettre de ranger deux casques jet (ou un casque int&eacute;gral) ou servir de support de stockage, qui peut &ecirc;tre verrouill&eacute; (cl&eacute;s fournies dans l&rsquo;emballage).</p>\', \'pet-on-wheels-top-case-de-transport-universel-pour-chien-et-chat.jpeg\', 200, \'pet-on-wheels-top-case-de-transport-universel-pour-chien-et-chat\', \'Pet on Wheels\', \'Blanc\', \'Polipropilène, PA6 Poliamide\', \'42x42x37 cm\'),
                            (33, 6, \'Animalis - Gamelle Anti-glouton de 19cm pour Chien\', \'<p>Gamelle en plastique Animalis, pour croquette, permet d&#39;&eacute;viter au chien glouton de finir sa nourriture trop rapidement et &eacute;vite ainsi l&#39;&eacute;touffement, gr&acirc;ce &agrave; sa forme concave, celui-ci prendra son temps pour manger.<br />\r\n<br />\r\nCaract&eacute;ristiques:<br />\r\n<br />\r\n- &Eacute;vite l&#39;&eacute;touffement durant le repas<br />\r\n<br />\r\n- Forme concave<br />\r\n<br />\r\n- Plusieurs coloris disponible</p>\', \'animalis-gamelle-anti-glouton-de-19cm-pour-chien.jpeg\', 7, \'animalis-gamelle-anti-glouton-de-19cm-pour-chien\', \'Animalis\', \'Crème\', NULL, \'19 cm\'),
                            (34, 6, \'Animalis - Conteneur à Friandises\', \'<p>Seau refermable pour stocker les friandises de votre chien.</p>\', \'animalis-conteneur-a-friandises.jpeg\', 1, \'animalis-conteneur-a-friandises\', \'Animalis\', \'Blanc\', NULL, NULL),
                            (35, 6, \'Trixie - Parc à Chiots\', \'<p>- Id&eacute;al pour une utilisation &agrave; l&#39;int&eacute;rieur et l&#39;ext&eacute;rieur<br />\r\n- Prot&egrave;ge les c&acirc;bles, tapis, mobilier de l&#39;instinct naturel de grignoter des rongeurs<br />\r\n- Ouverture pour le biberon<br />\r\n- Peut se fixer au sol &agrave; l&#39;aide de piquets<br />\r\n- Pliable et peu encombrant<br />\r\n- Avec sac de transport</p>\', \'trixie-parc-a-chiots.jpeg\', 80, \'trixie-parc-a-chiots\', \'Trixie\', \'Blanc, Bleu\', \'Tissu\', \'72x65x7 cm\'),
                            (36, 6, \'HamiForm - Gamelle en Céramique avec Support Bois\', \'<p>Craquez pour cette gamelle design et moderne, r&eacute;alis&eacute;e pour votre chien et votre chat. Elle est compos&eacute;e d&rsquo;une &eacute;cuelle amovible en c&eacute;ramique que vous pourrez passer au lave vaisselle pour une hygi&egrave;ne optimale. Elle dispose &eacute;galement de patins antid&eacute;rapant pour &eacute;viter que l&#39;animal renverse le contenu de la gamelle. Disponible dans diff&eacute;rentes tailles.<br />\r\n<br />\r\nContenance d&#39;une gamelle 900ml.</p>\', \'hamiform-gamelle-en-ceramique-avec-support-bois.jpeg\', 32, \'hamiform-gamelle-en-ceramique-avec-support-bois\', \'HamiForm\', \'Boisé, Blanc\', \'Bois, Céramique\', \'23.5x23.5x13 cm\'),
                            (37, 6, \'Animalis - Étui avec 15 Sacs Propreté\', \'<p>Les sacs ramasse-crotte Animalis seront indispensables pour ramasser les excr&eacute;ments de votre chien, tout particuli&egrave;rement lors des balades en ville o&ugrave; cela est obligatoire.</p>\', \'animalis-etui-avec-15-sacs-proprete.jpeg\', 4, \'animalis-etui-avec-15-sacs-proprete\', \'Animalis\', \'Noir\', NULL, NULL),
                            (38, 6, \'Animalis - Gamelle Antidérapante\', \'<p>Cette gamelle antid&eacute;rapante Animalis est l&#39;id&eacute;al pour votre compagnon &agrave; quatre pattes. Vous pourrez ainsi servir &agrave; manger ou &agrave; boire &agrave; votre chat ou &agrave; votre chien dans cette gamelle tr&egrave;s facilement. Avec une bordure en caoutchouc, qui favorise son adh&eacute;rence au sol, cette gamelle est parfaite pour tous les types de chiens ainsi que pour les chats. Croquettes, friandises, eau, votre animal sera plus que conquis !</p>\', \'animalis-gamelle-antiderapante.jpeg\', 3, \'animalis-gamelle-antiderapante\', \'Animalis\', \'Bleu\', NULL, \'15 cm\'),
                            (39, 6, \'Animalis - Lanceur de Friandises\', \'<p>Ce lanceur de friandises pour chien de la marque Animalis permet de stimuler et r&eacute;compenser votre animal lors de vos balades. Il permet ainsi de cr&eacute;er de v&eacute;ritables moments de complicit&eacute; et d&#39;exercer votre animal sans vous fatiguer.</p>\r\n\r\n<p><strong>Simple d&#39;utilisation :</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<ul>\r\n <li>1. Ouvrir le r&eacute;cipient afin d&#39;ins&eacute;rer quelques friandises</li>\r\n  <li>2. Refermer le r&eacute;cipient et abaisser le m&eacute;canisme afin d&#39;introduire une friandise dans le lanceur</li>\r\n  <li>3. Appuyer sur le bouton pour rel&acirc;cher le m&eacute;canisme et lancer la friandise</li>\r\n</ul>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Accessoire id&eacute;al lors des balades pour permettre &agrave; votre chien de courir, sauter et stimuler ses r&eacute;flexes tout en jouant !</p>\', \'animalis-lanceur-de-friandises.jpeg\', 4, \'animalis-lanceur-de-friandises\', \'Animalis\', \'Bleu\', \'Plastique\', NULL),
                            (40, 6, \'Animalis - Gamelle Antidérapante Transparente\', \'<p>Cette gamelle antid&eacute;rapante Animalis est l&#39;id&eacute;al pour votre compagnon &agrave; quatre pattes. Vous pourrez ainsi servir &agrave; manger ou &agrave; boire &agrave; votre chat ou &agrave; votre chien dans cette gamelle tr&egrave;s facilement. Avec une bordure en caoutchouc, qui favorise son adh&eacute;rence au sol, cette gamelle est parfaite pour tous les types de chiens ainsi que pour les chats. Croquettes, friandises, eau, votre animal sera plus que conquis !</p>\', \'animalis-gamelle-antiderapante-transparente.jpeg\', 4, \'animalis-gamelle-antiderapante-transparente\', \'Animalis\', \'Bleu\', NULL, \'19 cm\'),
                            (41, 6, \'Animalis - Gamelle Double Anti-fourmis\', \'<p>Gamelle double anti-fourmis avec un emplacement qui permet d&#39;isoler nourriture de votre animal aux fourmis par exemple.</p>\', \'animalis-gamelle-double-anti-fourmis.jpeg\', 10, \'animalis-gamelle-double-anti-fourmis\', \'Animalis\', \'Violet\', \'Mélamine\', \'7.2x23.5x13.5 cm\'),
                            (42, 9, \'Animalis - Jouet Girafe en Corde\', \'<p>Jouet peluche pour chien avec cou et queue en corde et couinement int&eacute;gr&eacute; dans le corps de la peluche qui permet de stimuler le jeu chez votre animal de compagnie.</p>\', \'animalis-jouet-girafe-en-corde.jpeg\', 8, \'animalis-jouet-girafe-en-corde\', \'Animalis\', \'Marron\', \'Polyester\', \'31x6x6 cm\'),
                            (43, 9, \'Corde + Balle Tennis\', \'<p>Jouet pour petit chien et miniature en corde 100% coton avec balle de tennis.<br />\r\nTr&egrave;s r&eacute;sistant.<br />\r\n<br />\r\nSatisfait le besoin naturel de mordiller !</p>\', \'corde-balle-tennis.jpeg\', 3, \'corde-balle-tennis\', \'Anka\', \'Jaune, Bleu\', NULL, \'19 cm\'),
                            (44, 9, \'Animalis - Jouet Sanglier - Rouge\', \'<p>Sp&eacute;cifiquement cr&eacute;&eacute; pour les chiens qui aiment jouer et m&acirc;cher, la collection Duraspikes est faite de toile durable en coton avec des pointes de TPR novatrices model&eacute;es sur le tissu pour que votre chien puisse s&#39;amuser avec !</p>\r\n\r\n<p><strong>Caract&eacute;ristiques :</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<ul>\r\n  <li>Con&ccedil;u pour r&eacute;sister aux m&acirc;chouillages</li>\r\n  <li>Pics en caoutchouc</li>\r\n <li>Corps en toile de coton</li>\r\n  <li>Tissu renforc&eacute;</li>\r\n  <li>Look unique</li>\r\n</ul>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Jouet parfait pour votre chien !</p>\', \'animalis-jouet-sanglier-rouge.jpeg\', 25, \'animalis-jouet-sanglier-rouge\', \'Animalis\', \'Rouge\', \'Coton\', \'29x14x18 cm\'),
                            (45, 9, \'Anka - Jouet Os - M\', \'<p>Une vrai alternative aux os de boucher qui peuvent &ecirc;tre dangereux pour votre chien (os cass&eacute; = formation d&#39;esquilles qui peuvent causer des perforations). Ses fibres de nylon et picots agissent comme une brosse &agrave; dents et permettent ainsi de r&eacute;duire la plaque dentaire tout en massant les gencives. Le processus de mastication emp&ecirc;che la formation de plaque dentaire et renforce les muscles de la m&acirc;choire.<br />\r\n<br />\r\nEn dehors du plaisir qu&#39;il procure, RAW NYLON assure une mastication durable et s&#39;use tr&egrave;s lentement !</p>\', \'anka-jouet-os-m.jpeg\', 12, \'anka-jouet-os-m\', \'Anka\', \'Blanc\', NULL, \'20 cm\'),
                            (46, 9, \'Jouet Les P  Tits Cochons Joe\', \'<p>Jouet pour chien en latex avec organe sonore imitant le bruit du cochon ! Convient aux chiens de moyennes et grandes tailles.</p>\', \'jouet-les-ptits-cochons-joe.jpeg\', 10, \'jouet-les-ptits-cochons-joe\', \'Anka\', \'Rose\', \'Caoutchouc\', \'8x12x31 cm\'),
                            (47, 9, \'Jouet Hippopotame en Corde\', \'<p>Jouet peluche pour chien avec cou et queue en corde et couinement int&eacute;gr&eacute; dans le corps de la peluche qui permet de stimuler le jeu chez votre animal de compagnie.</p>\', \'jouet-hippopotame-en-corde.jpeg\', 8, \'jouet-hippopotame-en-corde\', \'Animalis\', \'Gris\', \'Polyester\', \'31x6x6 cm\'),
                            (48, 9, \'Jouet Rugby ON/OFF Sonore Gigwi\', \'<p>Jouet sonore de la gamme Animalis Gigwi qui&nbsp;<strong>int&egrave;gre une option ON/OFF</strong>&nbsp;permettant d&#39;arr&ecirc;ter le son afin que votre chien s&#39;amuse sans bruit. C&#39;est un jouet sonore id&eacute;al pour l&#39;eveil de votre animal et stimule son activit&eacute; ! Il est facile d&#39;utilisation et simple &agrave; prendre en main.</p>\r\n\r\n<p>Ce produit est destin&eacute; aux animaux uniquement. &Agrave; utiliser sous la surveillance du ma&icirc;tre et v&eacute;rifier r&eacute;guli&egrave;rement l&#39;int&eacute;grit&eacute; du produit afin d&#39;&eacute;viter tout risque d&#39;ingestion de petits morceaux.</p>\', \'jouet-rugby-on-off-sonore-gigwi.jpeg\', 10, \'jouet-rugby-on-off-sonore-gigwi\', \'Animalis\', \'Bleu\', \'Thermo-propylen\', \'7x7x27.5 cm\'),
                            (49, 9, \'Jouet Jumball Gigwi Ballon de Basket\', \'<p>Jouet Jumpball d&#39;eveil de la gamme Animalis Gigwi pour votre animal et stimule son activit&eacute; ! Facile &agrave; prendre en main gr&acirc;ce &agrave; sa poign&eacute;e, &agrave; sa mati&egrave;re en caoutchouc et facile a rattraper pour votre animal.</p>\r\n\r\n<p>Ce produit est destin&eacute; aux animaux uniquement. &Agrave; utiliser sous la surveillance du ma&icirc;tre et v&eacute;rifier r&eacute;guli&egrave;rement l&#39;int&eacute;grit&eacute; du produit afin d&#39;&eacute;viter tout risque d&#39;ingestion de petits morceaux.</p>\', \'jouet-jumball-gigwi-ballon-de-basket.jpeg\', 17, \'jouet-jumball-gigwi-ballon-de-basket\', \'Animalis\', \'Rouge, Jaune\', \'Thermo-propylen\', \'20x20x26 cm\'),
                            (50, 9, \'Jouet Frisbee Gigwi\', \'<p>Jouet d&#39;eveil de la gamme Animalis Gigwi pour votre animal et stimule son activit&eacute; ! Facile &agrave; prendre en main, mati&egrave;re en caoutchouc et facile a rattraper pour votre animal.</p>\r\n\r\n<p>Ce produit est destin&eacute; aux animaux uniquement. &Agrave; utiliser sous la surveillance du ma&icirc;tre et v&eacute;rifier r&eacute;guli&egrave;rement l&#39;int&eacute;grit&eacute; du produit afin d&#39;&eacute;viter tout risque d&#39;ingestion de petits morceaux.</p>\', \'jouet-frisbee-gigwi.jpeg\', 15, \'jouet-frisbee-gigwi\', \'Animalis\', \'Rouge\', \'Thermo-propylen\', \'24.3x24.3x2.5 cm\'),
                            (51, 9, \'Jouet Roll\', \'<p>Le Foaber Roll est compos&eacute; d&#39;un alliage innovant et unique de mousse et de caoutchouc utilisant la technologie Foaber Cell. Cet nouveau mat&eacute;riaux hybride permet &agrave; la fois d&#39;obtenir un jouet l&eacute;ger, flottant et parfaitement doux pour les dents et les gencives, mais &eacute;galement dou&eacute; d&#39;un fort rebond et r&eacute;sistant.</p>\r\n\r\n<p><strong>Avantages du Roll de Foaber :</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<ul>\r\n  <li>R&eacute;sistant</li>\r\n <li>Flottant</li>\r\n <li>Doux : pour les dents et les gencives</li>\r\n  <li>Facile &agrave; retrouver</li>\r\n  <li>Fort rebond</li>\r\n</ul>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Les couleurs du jouet sont adapt&eacute;es au spectre de vision du chien pour plus de visibilit&eacute; lorsqu&#39;utilis&eacute; &agrave; l&#39;ext&eacute;rieur ou lanc&eacute; sur de longue distance.</p>\', \'jouet-roll.jpeg\', 18, \'jouet-roll\', \'Foaber\', \'Jaune, Bleu\', NULL, \'16x3x3 cm\'),
                            (52, 10, \'Tapis Éducateurs\', \'<p>Tapis &eacute;ducateur destin&eacute; au chiot ou chien pour l&#39;apprentissage &agrave; la propret&eacute;. Tr&egrave;s absorbant</p>\', \'tapis-educateurs.jpeg\', 10, \'tapis-educateurs\', \'Animalis\', \'Blanc\', NULL, \'45x60 cm\'),
                            (53, 10, \'Spray Attractif Éducateur\', \'<p>Le spray attractif &eacute;ducateur Animalis aux extraits de plantes, facilite l&#39;&eacute;ducation &agrave; la propret&eacute; des chiots et chatons : pulv&eacute;ris&eacute; vers la liti&egrave;re ou le tapis &eacute;ducateur, il inciter &agrave; uriner &agrave; l&#39;endroit souhait&eacute;.</p>\', \'spray-attractif-educateur.jpeg\', 7, \'spray-attractif-educateur\', \'Animalis\', \'Blanc\', \'Eau de cataire\', \'13.5x18x17.5 cm\'),
                            (54, 10, \'Doigtier Brosse à Dents\', \'<p>La brosse &agrave; dents doigtier de Beaphar permet un&nbsp;<strong>nettoyage complet et pr&eacute;cis</strong>&nbsp;de la dentition de votre animal.<br />\r\nIl est important de brosser r&eacute;guli&egrave;rement ses dents afin d&rsquo;&eacute;liminer la plaque dentaire, le tartre et de limiter la mauvaise haleine. Pratique et facile &agrave; utiliser pour redonner une haleine fra&icirc;che &agrave; votre animal avec un nettoyage complet<br />\r\n<br />\r\n<strong>Conseils d&#39;utilisation :</strong>&nbsp;Mouiller l&eacute;g&egrave;rement la brosse et ajouter une noix de dentifrice Beaphar. S&rsquo;assurer que l&rsquo;animal est pr&ecirc;t &agrave; recevoir un soin bucco-dentaire. Brosser avec d&eacute;licatesse toutes les dents et nettoyer la brosse apr&egrave;s usage.</p>\', \'doigtier-brosse-a-dents.jpeg\', 4, \'doigtier-brosse-a-dents\', \'Beaphar\', \'Rouge\', NULL, \'10x2.5x14.8 cm\'),
                            (55, 10, \'Parfum Senteur Miel Doux\', \'<p>Parfum doux senteur d&eacute;licate et fabriqu&eacute; en France.</p>\r\n\r\n<p><strong>Mode d&#39;emploi :</strong>&nbsp;pulv&eacute;riser le parfum sur les poils de l&#39;animal en &eacute;vitant les zones sensibles.</p>\r\n\r\n<p><strong>Pr&eacute;caution d&#39;emploi :</strong>&nbsp;&agrave; ne pas utiliser sur les animaux malades, convalescents, en cours de gestation ou &acirc;g&eacute; de moins de 3 mois.</p>\', \'parfum-senteur-miel-doux.jpeg\', 10, \'parfum-senteur-miel-doux\', \'Animalis\', NULL, NULL, NULL),
                            (56, 10, \'Anti-tartre Plaque Destructor\', \'<p>Poudre d&#39;algues anti tartre &agrave; mettre sur les croquettes</p>\', \'anti-tartre-plaque-destructor.jpeg\', 10, \'anti-tartre-plaque-destructor\', \'Bubimex\', \'Blanc\', NULL, \'8x8x12 cm\'),
                            (57, 10, \'Gant de Brossage et Massage\', \'<p>Gr&acirc;ce &agrave; ce gant de massage et de brossage pour animaux avec picots en silicone, prenez soin de votre animal et de son pelage !</p>\r\n\r\n<p><strong>Caract&eacute;ristiques :</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<ul>\r\n <li>Pour tous les chiens et chats</li>\r\n  <li>Picots en silicone</li>\r\n <li>Soin doux pour le poils</li>\r\n  <li>Lavage &agrave; la main</li>\r\n</ul>\', \'gant-de-brossage-et-massage.jpeg\', 5, \'gant-de-brossage-et-massage\', \'Animalis\', \'Noir, Bleu\', \'Polypropylène\', \'24.5x18.5x2 cm\'),
                            (58, 10, \'Collier Antiparasitaire Noir\', \'<p>Collier antiparasitaire externe de la marque Animalis afin de lutter contre les puces et les tiques pendant 3 mois. Ce collier est biod&eacute;gradable, il se jette au bac &agrave; compost apr&egrave;s utilisation.</p>\r\n\r\n<p><strong>Caract&eacute;ristiques :</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<ul>\r\n <li>100% Biod&eacute;gradable</li>\r\n  <li>Repousse puces et tiques</li>\r\n <li>Collier : 41 centim&egrave;tres</li>\r\n  <li>Pour petit chien (2 &agrave; 15 kilos)</li>\r\n <li>Pour chien de plus de 2 mois</li>\r\n <li>Taille r&eacute;glable</li>\r\n <li>Couleur : Noir</li>\r\n</ul>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Fabriqu&eacute; en France.</strong></p>\', \'collier-antiparasitaire-noir.jpeg\', 5, \'collier-antiparasitaire-noir\', \'Animalis\', \'Noir\', NULL, \'12x2x16 cm\'),
                            (59, 10, \'Spray Répulsif d  Intérieur\', \'<p>Le spray r&eacute;pulsif d&#39;int&eacute;rieur Animalis aux extraits de Lavandin est sp&eacute;cialement formul&eacute; pour &eacute;loigner tous les chiens des zones &agrave; prot&egrave;ger. Il est sans danger pour les autres animaux et les plantes et son parfum est naturel et agr&eacute;able.</p>\', \'spray-repulsif-dinterieur.jpeg\', 10, \'spray-repulsif-dinterieur\', \'Animalis\', \'Blanc\', \'HE Lavandin\', \'24.3x32.4x26.8 cm\')');
        $this->addSql('INSERT INTO `product` (`id`, `sub_category_id`, `title`, `description`, `photo`, `price`, `slug`, `marque`, `color`, `composition`, `dimension`) VALUES
                            (60, 10, \'Serviette de Toilettage\', \'<p>Serviette de toilettage pour chien, parfait pour s&eacute;cher votre animal de compagnie &agrave; la sortie du bain !</p>\', \'serviette-de-toilettage.jpeg\', 9, \'serviette-de-toilettage\', \'Animalis\', \'Gris\', NULL, \'73x41 cm\'),
                            (61, 11, \'Collier Cuir et Nylon - Noir\', \'<p><strong>Kacpadi</strong>&nbsp;est une entreprise familiale de plus de 100 ans de tradition qui s&#39;est sp&eacute;cialis&eacute;e dans la production d&#39;accessoires pour animaux. Les premiers produits introduits au d&eacute;but du si&egrave;cle dernier &eacute;taient les harnais et brides pour chevaux. Aujourd&#39;hui la marque d&eacute;veloppe des produits pour animaux de compagnie de haute qualit&eacute; fait main avec un savoir-faire unique !</p>\r\n\r\n<p>Collier de haute qualit&eacute; en cuir v&eacute;ritable et ruban en nylon color&eacute; pour chien. Chaque collier comprend un anneau en D solide et soud&eacute;. Les mati&egrave;res premi&egrave;res utilis&eacute;es pour la production proviennent de fournisseurs europ&eacute;ens.</p>\r\n\r\n<p>Chaque collier comprend un cercle r&eacute;fl&eacute;chissant qui rendra le chien plus visible.</p>\', \'collier-cuir-et-nylon-noir.jpg\', 7, \'collier-cuir-et-nylon-noir\', \'Kacpadi\', \'Noir\', \'Cuir\', NULL),
