                            (65, 11, \'Collier Cuir et Nylon - Rouge\', \'<p><strong>Kacpadi</strong>&nbsp;est une entreprise familiale de plus de 100 ans de tradition qui s&#39;est sp&eacute;cialis&eacute;e dans la production d&#39;accessoires pour animaux. Les premiers produits introduits au d&eacute;but du si&egrave;cle dernier &eacute;taient les harnais et brides pour chevaux. Aujourd&#39;hui la marque d&eacute;veloppe des produits pour animaux de compagnie de haute qualit&eacute; fait main avec un savoir-faire unique !</p>\r\n\r\n<p>Collier de haute qualit&eacute; en cuir v&eacute;ritable et ruban en nylon color&eacute; pour chien. Chaque collier comprend un anneau en D solide et soud&eacute;. Les mati&egrave;res premi&egrave;res utilis&eacute;es pour la production proviennent de fournisseurs europ&eacute;ens.</p>\r\n\r\n<p>Chaque collier comprend un cercle r&eacute;fl&eacute;chissant qui rendra le chien plus visible.</p>\', \'collier-cuir-et-nylon-rouge.jpeg\', 7, \'collier-cuir-et-nylon-rouge\', \'Kacpadi\', \'Rouge\', \'Cuir\', NULL),
                            (66, 11, \'Collier Cuir et Nylon - Vert\', \'<p><strong>Kacpadi</strong>&nbsp;est une entreprise familiale de plus de 100 ans de tradition qui s&#39;est sp&eacute;cialis&eacute;e dans la production d&#39;accessoires pour animaux. Les premiers produits introduits au d&eacute;but du si&egrave;cle dernier &eacute;taient les harnais et brides pour chevaux. Aujourd&#39;hui la marque d&eacute;veloppe des produits pour animaux de compagnie de haute qualit&eacute; fait main avec un savoir-faire unique !</p>\r\n\r\n<p>Collier de haute qualit&eacute; en cuir v&eacute;ritable et ruban en nylon color&eacute; pour chien. Chaque collier comprend un anneau en D solide et soud&eacute;. Les mati&egrave;res premi&egrave;res utilis&eacute;es pour la production proviennent de fournisseurs europ&eacute;ens.</p>\r\n\r\n<p>Chaque collier comprend un cercle r&eacute;fl&eacute;chissant qui rendra le chien plus visible.</p>\', \'collier-cuir-et-nylon-vert.jpeg\', 7, \'collier-cuir-et-nylon-vert\', \'Kacpadi\', \'Vert\', \'Cuir\', NULL),
                            (67, 11, \'Collier Anti-aboiement Deluxe pour Grand Chien\', \'<p>Pour chiens de plus de 18 kilos, technologie PerfectBark, 10 niveaux de stimulation&agrave; r&eacute;glage automatique, collier &eacute;tanche</p>\', \'collier-anti-aboiement-deluxe-pour-grand-chien.jpeg\', 135, \'collier-anti-aboiement-deluxe-pour-grand-chien\', \'PetSafe\', \'Noir\', NULL, \'23.3x17.9x14.3 cm\'),
                            (68, 11, \'Collier GPS Connecté Dogs²\', \'<p><strong>Weenect Dogs 2 est un traceur GPS pour chien connect&eacute; aux smartphones des ma&icirc;tres via une application mobile disponible sur Android et iPhone.</strong></p>\r\n\r\n<p>Il est &eacute;quip&eacute; d&#39;une carte SIM incluse dans le produit qui permet un fonctionnement sans limite de distance (contrairement aux traceurs bluetooth dont la port&eacute;e est limit&eacute;e &agrave; quelques m&egrave;tres). La carte SIM est multi-r&eacute;seaux pour une couverture maximale du territoire (99%), m&ecirc;me dans les zones recul&eacute;es comme les for&ecirc;ts ou la montagne par exemple. Votre op&eacute;rateur n&#39;a aucune incidence sur le fonctionnement du service.</p>\r\n\r\n<p>Le suivi GPS se fait en temps r&eacute;el (jusqu&#39;&agrave; une position toutes les 10 secondes) et vient accompagner d&#39;autres fonctionnalit&eacute;s comme l&#39;analyse de territoire ou bien encore le dressage (pour faire revenir votre animal par simple pression d&#39;un bouton).</p>\r\n\r\n<p>Weenect fonctionne dans plus de 100 pays, sans limite de distance. Vous pouvez &ecirc;tre &agrave; Berlin et votre animal &agrave; Paris, la qualit&eacute; de service sera toujours parfaite.</p>\r\n\r\n<p><strong>CARACT&Eacute;RISTIQUES TECHNIQUES :</strong></p>\r\n\r\n<p><strong>Compatibilit&eacute;</strong><br />\r\nApple iOS 10.3 ou sup&eacute;rieur<br />\r\nAndroid 4.1 ou sup&eacute;rieur<br />\r\nWeb app pour ordinateur et smartphone</p>\r\n\r\n<p><strong>Batterie</strong><br />\r\n550 mA/H, 4 jours</p>\r\n\r\n<p><strong>FONCTIONNALIT&Eacute;S</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<ul>\r\n <li>Localisation GPS illimit&eacute;e et sans limite de distance</li>\r\n <li>Alerte anti-fugue et suivi d&#39;activit&eacute;</li>\r\n <li>Dressage et appel vocal</li>\r\n  <li>Notifications de batterie faible (30% et 15%) et &Eacute;tanche (IP67)</li>\r\n <li>Application iPhone et Android, suivable par toute la famille</li>\r\n</ul>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Fonctionne avec abonnement :</strong>&nbsp;(&agrave; partir de 3,50&curren;/mois) cet abonnement se choisit au moment de l&#39;enregistrement du traceur (&agrave; sa r&eacute;ception) sur le site my.weenect.com.</p>\r\n\r\n<p><strong>La boite contient :</strong>&nbsp;un traceur GPS Weenect Dogs 2, un c&acirc;ble USB, un socle de chargement et une coque silicone attachable sur tous colliers.</p>\', \'collier-gps-connecte-dogs2.jpeg\', 80, \'collier-gps-connecte-dogs2\', \'Weenect\', \'Blanc\', \'Plastique\', \'5x1x5 cm\'),
                            (69, 11, \'Harnais Power Baby 1\', \'<p>Unique en son genre, le harnais K9-Power de Julius-K9 est adapt&eacute; &agrave; toutes les utilisations : harnais de travail et de s&eacute;curit&eacute; pour les chiens de service, pistage, sauvetage ou tout simplement pour le loisir et la promenade. Tr&egrave;s facile &agrave; mettre sur votre chien, le harnais s&rsquo;enfile par la t&ecirc;te et non par les pattes comme les harnais standards. Il existe en plusieurs tailles pour un ajustement parfait (voir le tableau dans les visuels du produit) et &eacute;galement en diff&eacute;rents coloris.&nbsp;<br />\r\n<br />\r\n<strong>Caract&eacute;ristiques de ce harnais Julius-K9 :</strong><br />\r\n<br />\r\n&bull; taille du harnais : Baby 1<br />\r\n&bull; tour de poitrine : 29 - 36 centim&egrave;tres<br />\r\n&bull; poids du chien : 1 - 3 kilos<br />\r\n&bull; coloris : Noir<br />\r\n<br />\r\nCe harnais de qualit&eacute; sup&eacute;rieure est agr&eacute;able &agrave; porter gr&acirc;ce &agrave; ses deux ceintures larges au niveau du poitrail et du ventre et &agrave; son rembourrage au niveau du dos. Il est robuste en mat&eacute;riau ext&eacute;rieur polyester anti-rayures et r&eacute;sistant &agrave; l&rsquo;eau, la ceinture de poitrine et les bords du harnais sont r&eacute;fl&eacute;chissants, ce qui garantit une bonne visibilit&eacute;. La poign&eacute;e situ&eacute;e au dessus du harnais permet de guider le chien facilement tout en ayant la possibilit&eacute; de le tirer rapidement si besoin. La fixation par velcro garantit une conduite parfaite du chien gr&acirc;ce &agrave; sa stabilit&eacute;. La ceinture au niveau du poitrail est r&eacute;glable. Boucle en forme de D stable en inox au dos du harnais pour la fixation de la laisse.<br />\r\n<br />\r\n<strong>Veillez &agrave; bien mesurer le tour de poitrail de votre chien avant toute commande. Le prix du harnais varie &eacute;galement en fonction de la taille et de la couleur.</strong><br />\r\n<br />\r\nPour bien choisir la taille de votre harnais Julius K-9, il vous suffit de mesurer le tour de poitrail de votre chien derri&egrave;re les pattes avant puis de s&eacute;lectionner la taille de mani&egrave;re ce que le tour de poitrail de votre chien soit bien au milieu des dimensions indiqu&eacute;es dans le tableau ci-dessus en visuel produit. Vous pouvez vous aidez des visuels pr&eacute;sents sur la fiche produit pour mesurer la taille et s&eacute;lectionner le bon harnais Julius-K9.</p>\', \'harnais-power-baby-1.jpeg\', 23, \'harnais-power-baby-1\', \'Julius-K9\', \'Noir\', \'Tissu\', \'36 cm\'),
                            (70, 5, \'Orijen - Croquettes Puppy Large pour Chiot\', \'<p>ORIJEN Puppy Large d&eacute;borde de prot&eacute;ines provenant de poulet et de dinde &eacute;lev&eacute;s en libert&eacute;, de poissons sauvages entiers et d&#39;oeufs entiers pondus au nid, tous dans des proportions WholePrey(TM) nutritives. Sa teneur en calories et en min&eacute;raux est sp&eacute;cifiquement &eacute;tudi&eacute;e pour les chiots de grandes races</p>\', \'orijen-croquettes-puppy-large-pour-chiot.jpeg\', 20, \'orijen-croquettes-puppy-large-pour-chiot\', \'Orijen\', \'violet\', NULL, NULL),
                            (71, 5, \'Orijen - Croquettes Regional Red pour Chien\', \'<p>ORIJEN Regional Red regorge de boeuf Angus, de sanglier, de bison des Plaines, d&#39;agneau Romney et de porc Yorkshire, &eacute;lev&eacute;s dans des ranchs de l&#39;Alberta. Tous sont livr&eacute;s FRAIS ou CRUS dans des proportions WholePrey(TM) pour offrir un r&eacute;gime complet &agrave; votre chien</p>\', \'orijen-croquettes-regional-red-pour-chien.jpeg\', 20, \'orijen-croquettes-regional-red-pour-chien\', \'Orijen\', \'marron\', NULL, NULL),
                            (72, 5, \'Orijen - Croquettes Puppy pour Chiot\', \'<p>ORIJEN Puppy regorge de prot&eacute;ines et de mati&egrave;res grasses naturelles provenant de v&eacute;ritables viandes fra&icirc;ches, y compris du poulet et de la dinde &eacute;lev&eacute;s en libert&eacute;, de poissons sauvages et d&#39;oeufs entiers pondus au nid. Tous sont inclus dans des proportions WholePrey(TM) tr&egrave;s nutritives</p>\', \'orijen-croquettes-puppy-pour-chiot.jpeg\', 20, \'orijen-croquettes-puppy-pour-chiot\', \'Orijen\', \'jaune\', NULL, NULL),
                            (73, 5, \'Acana - Croquettes Heritage Adult Large Breed pour Chien\', \'<p>Les articulations des chiens de grande race subissent davantage de stress. ACANA Adult Large Breed est riche en prot&eacute;ines animales afin de favoriser le d&eacute;veloppement d&#39;une masse musculaire maigre, mais faible en glucides et en calories pour contribuer au maintien d&#39;un poids sain et de r&eacute;duire au minimum le stress sur les os et les articulations</p>\', \'acana-croquettes-heritage-adult-large-breed-pour-chien.jpeg\', 65.99, \'acana-croquettes-heritage-adult-large-breed-pour-chien\', \'Acana\', \'marron\', NULL, NULL),
                            (74, 5, \'Acana - Croquettes Regionals Wild Prairie pour Chien\', \'<p>D&eacute;bordant de dinde et de poulet &eacute;lev&eacute;s en libert&eacute;, d&#39;&oelig;ufs entiers et de poissons sauvages, livr&eacute;s frais ou crus depuis la r&eacute;gion, ACANA Wild Prairie nourrit votre chien de fa&ccedil;on naturelle, sans longue liste d&#39;additifs. Avec peu de glucides mais beaucoup de prot&eacute;ines animales, cette alimentation favorise une condition physique optimale pour tous les chiens</p>\', \'acana-croquettes-regionals-wild-prairie-pour-chien.jpeg\', 42.64, \'acana-croquettes-regionals-wild-prairie-pour-chien\', \'Acana\', \'jaune\', NULL, NULL),
                            (75, 5, \'Acana - Croquettes Singles Grass-Fed Lamb pour Chien\', \'<p>ACANA Grass-Feb Lamb se compose d&#39;agneau cru en proportions WholePrey pour &eacute;liminer le besoin d&#39;ajouter des additifs synth&eacute;tiques. De g&eacute;n&eacute;reuses infusions de foie lyophilis&eacute; plaisent aux plus difficiles, tandis que les pommes, courges et citrouilles fra&icirc;ches procurent une source &eacute;lev&eacute;e de fibres solubles afin de calmer les estomacs sensibles</p>\', \'acana-croquettes-singles-grass-fed-lamb-pour-chien.jpeg\', 25.31, \'acana-croquettes-singles-grass-fed-lamb-pour-chien\', \'Acana\', \'violet\', NULL, NULL),
                            (76, 5, \'Acana - Croquettes Regionals Pacifica pour Chien\', \'<p>D&eacute;bordant de hareng, de sardines, de plie, de merlu argent&eacute; et de s&eacute;baste sauvages livr&eacute;s frais ou crus et p&ecirc;ch&eacute;s au nord de Vancouver, ACANA Pacifica est &agrave; l&#39;image du r&eacute;gime naturel de votre chien. Faible en glucides et riche en prot&eacute;ines de poissons, cette alimentation favorise une condition physique optimale chez les chiens</p>\', \'acana-croquettes-regionals-pacifica-pour-chien.jpeg\', 23.54, \'acana-croquettes-regionals-pacifica-pour-chien\', \'Acana\', \'bleu\', NULL, NULL),
                            (77, 5, \'Acana - Croquettes Singles Yorkshire Pork pour Chien\', \'<p>ACANA Yorkshire Pork se compose de porc frais &eacute;lev&eacute; dans des fermes des prairies de l&#39;Alberta dans des proportions WholePrey ce qui &eacute;limine le besoin de recourir &agrave; des additifs artificiels. Les g&eacute;n&eacute;reuses infusions de foie lyophilis&eacute; plaisent aux plus fins palais, tandis que la courge musqu&eacute;e et la citrouille fra&icirc;ches constituent une source &eacute;lev&eacute;e de fibres solubles parfaites pour les estomacs fragiles</p>\', \'acana-croquettes-singles-yorkshire-pork-pour-chien.jpeg\', 24.21, \'acana-croquettes-singles-yorkshire-pork-pour-chien\', \'Acana\', \'vert\', NULL, NULL),
                            (78, 5, \'Acana - Croquettes Classics Wild Coast pour Chien\', \'<p>ACANA Wild Coast contient du poisson p&ecirc;ch&eacute; &agrave; l&#39;&eacute;tat sauvage &agrave; l&#39;aide de m&eacute;thodes durables, au nord de l&#39;&icirc;le de Vancouver et rapidement livr&eacute; &agrave; nos cuisines frais et entiers, donc d&eacute;bordant de bienfaits et de saveurs. Sans c&eacute;r&eacute;ales &agrave; indice glyc&eacute;mique &eacute;lev&eacute;, cette alimentation favorise une condition physique optimale</p>\', \'acana-croquettes-classics-wild-coast-pour-chien.jpeg\', 20.32, \'acana-croquettes-classics-wild-coast-pour-chien\', \'Acana\', \'bleu\', NULL, NULL),
                            (79, 5, \'Acana - Croquettes Classics Classic Red pour Chien\', \'<p>ACANA Classic Red renferme de l&#39;agneau nourri &agrave; l&#39;herbe, du b&oelig;uf angus et du porc Yorkshire livr&eacute;s frais ou crus tous les jours, dans des proportions WholePrey, afin d&#39;offrir une alimentation compl&egrave;te &agrave; votre chien. Sans c&eacute;r&eacute;ales &agrave; indice glyc&eacute;mique &eacute;lev&eacute;, cette alimentation favorise une condition physique optimale</p>\', \'acana-croquettes-classics-classic-red-pour-chien.jpeg\', 23.54, \'acana-croquettes-classics-classic-red-pour-chien\', \'Acana\', \'rouge\', NULL, NULL),
                            (80, 7, \'Ferplast Relax Coussin coton\', \'Relax est un coussin en tissu de forme ovale pour chiens et chats. Il s  intègre facilement dans les corbeilles en plastique de la gamme Siesta Deluxe . Il est disponible en six tailles pour animaux de toutes tailles et dans des couleurs variées . Il peut être lavé en machine à  30Â° C . Pour les chats et chiens de petite taille, vous pourrez opter pour les modèles 45, 55, 65 et 78, pour les chiens de moyenne et grande taille vous pourrez choisir le relax 89 et 100.\', \'ferplast-relax-coussin-coton.jpeg\', 7.5, \'ferplast-relax-coussin-coton\', \'Ferplast\', \'violet\', \'Tissu\', NULL),
                            (81, 7, \'Animalis - Plaid Bi-matière pour Chiens - Prune\', \'Plaid en tissu velours très doux mixé avec un tissu peluche pour obtenir une douceur et un confort maximum. Plaid tout en souplesse, étiquette tissée et logo Animalis cousue. Une face en tissu peluche et une autre en velours doux.\', \'animalis-plaid-bi-matiere-pour-chiens-prune.jpeg\', 20, \'animalis-plaid-bi-matiere-pour-chiens-prune\', \'Animalis\', \'violet\', \'Polyester\', \'110x75 cm\'),
                            (82, 7, \'Animalis - Coussin Bleu pour Chien - L\', \'Choisissez l  élégance et le design pour votre animal de compagnie qui lui aussi aura son coussin de sol !Sa fermeture éclair vous permettra de le nettoyer très facilement . \', \'animalis-coussin-bleu-pour-chien-l.jpeg\', 40, \'animalis-coussin-bleu-pour-chien-l\', \'Animalis\', \'gris\', \'Tissu\', \'102x73x12 cm\'),
                            (83, 7, \'Animalis - Plaid avec Motif Noir pour Chien - L\', \'Le plaid de la marque Animalis est un accessoire pratique qui rendra le quotidien de votre chien encore plus agréable ! Elle peut s  utiliser à la maison au sol ou sur votre canapé pour le protéger mais également en transport sur vos sièges de voiture pour lutter contre les poils et la saleté . Vous apprécierez les motifs pattes du plaid et votre chien son confort . \', \'animalis-plaid-avec-motif-noir-pour-chien-l.jpeg\', 11, \'animalis-plaid-avec-motif-noir-pour-chien-l\', \'Animalis\', \'noir\', NULL, \'120x150 cm\'),
                            (84, 7, \'Animalis - Coussin Rouge pour Chien - S\', \'<p>Coussin rectangulaire en tissu pour chien et chat</p>\', \'animalis-coussin-rouge-pour-chien-s.jpeg\', 26, \'animalis-coussin-rouge-pour-chien-s\', \'Animalis\', \'gris\', \'Tissu\', \'78x58x12 cm\'),
                            (85, 7, \'Animalis - Matelas Rouge pour Chien - M\', \'<p>Gamme de couchage pour chien de la marque Animalis pour le confort de votre compagnon</p>\', \'animalis-matelas-rouge-pour-chien-m.jpeg\', 25, \'animalis-matelas-rouge-pour-chien-m\', \'Animalis\', \'gris, rouge\', \'Polyester\', \'68x53x10 cm\'),
                            (86, 7, \'Ferplast - Corbeille Siesta Deluxe en Plastique\', \'Cette corbeille en plastique siesta deluxe 8 offrira à votre chien un couchage des plus spacieux et des plus confortables. Il pourra ainsi se reposer dans un espace bien à lui et se laisser aller à des nuits pleines de volupté. Les tons bronze et gris de cette corbeille en plastique s  intégreront parfaitement à votre décoration d  intérieur et y apporteront une touche chic et design. En plastique, cette corbeille se nettoie à l  eau savonneuse . \', \'ferplast-corbeille-siesta-deluxe-en-plastique.jpeg\', 11, \'ferplast-corbeille-siesta-deluxe-en-plastique\', \'Ferplast\', \'gris\', \'Plastique\', NULL),
                            (87, 7, \'Sömn - Coussin Oval Budget Toronto pour Chien - S\', \'Coussin alliant confort, élégance tout en restant très fonctionnel, avec un rembourrage en flocon de mousse et en forme ovale qui conviendra parfaitement à votre petit compagnon ! Le motif à carreaux est à la fois classique et élégant. Lavable en machine à 30°.\', \'somn-coussin-oval-budget-toronto-pour-chien-s.jpeg\', 10, \'somn-coussin-oval-budget-toronto-pour-chien-s\', \'Sömn\', \'gris\', NULL, \'60x41x6 cm\'),
                            (88, 7, \'Vadigran - Canapé Waterblue pour Chiens\', \'<p>Canap&eacute; confortable en su&eacute;dine de bonne qualit&eacute;</p>\', \'vadigran-canape-waterblue-pour-chiens.jpeg\', 125, \'vadigran-canape-waterblue-pour-chiens\', \'Vadigran\', \'bleu\', NULL, \'70x39x41 cm\'),
                            (89, 7, \'Ferplast - Niche Kenny 7 en Plastique\', \'Cette niche Kenny 07 en plastique beige et marron deviendra le lieu de refuge préféré de votre compagnon de toujours. Cette niche, résistante aux chocs et aux UV, accueillera votre chien et le protégera des intempéries. Elle bénéficie du \"drain system\" qui apportera un environnement sec et antiseptique. Dotée d  une grille de ventilation, cette niche offrira une bonne aération, l  humidité ne stagnera pas à l  intérieur . Adaptée aux chiens de petite taille, cette niche sera un abri de qualité pour votre canidé et un élément décoratif pour votre extérieur . \', \'ferplast-niche-kenny-7-en-plastique-112x80x80cm.jpeg\', 165, \'ferplast-niche-kenny-7-en-plastique\', \'Ferplast\', \'Gris, Marron\', \'Plastique\', \'112x80x80 cm\'),
                            (90, 8, \'Animalis - Sac de Transport Ceinture Noir pour Chien et Chat - S\', \'<p>Transportez avec style et sans effort votre compagnon &agrave; quatre pattes lors de vos sorties avec ce sac en bandouli&egrave;re de qualit&eacute; ! Il est tr&egrave;s confortable et se porte facilement &agrave; l&#39;aide de sangles ajustables. Votre compagnon aura un emplacement de taille pour profiter de vous au plus pr&egrave;s tout en se reposant dans un espace cocooning sp&eacute;cialement &eacute;tudi&eacute; pour sa petite morphologie.</p>\', \'animalis-sac-de-transport-ceinture-noir-pour-chien-et-chat-s.jpeg\', 40, \'animalis-sac-de-transport-ceinture-noir-pour-chien-et-chat-s\', \'Animalis\', \'Noir\', \'Polyester\', \'50x32x15 cm\'),
                            (91, 8, \'Alcott - Ceinture de Sécurité Universelle Car Safety Belt pour Chien\', \'<p>Ceinture de s&eacute;curit&eacute; pour votre fid&egrave;le voyageur &agrave; 4 pattes ! La ceinture de la marque Alcott a &eacute;t&eacute; con&ccedil;ue de mani&egrave;re universelle, elle fonctionne avec les harnais Alcott mais aussi n&#39;importe quel harnais et collier.</p>\r\n\r\n<p>La ceinture est facilement ajustable afin de fournir &agrave; votre animal un confort parfait qu&#39;il soit assis ou coucher en voiture. Le ceinture peut m&ecirc;me &ecirc;tre utilis&eacute;e comme une laisse courte pour une balade rapide chez le v&eacute;t&eacute;rinaire, l&#39;animalerie ou chez des amis !</p>\', \'alcott-ceinture-de-securite-universelle-car-safety-belt-pour-chien.jpeg\', 9, \'alcott-ceinture-de-securite-universelle-car-safety-belt-pour-chien\', \'Alcott\', \'Noir\', NULL, NULL),
                            (92, 8, \'Imac - Caisse de Transport Kim 60 avec Roulettes pour Chien - L\', \'<p>Caisse de transport Kim, mod&egrave;le en PVC rigide. Avec roulettes et poign&eacute;e de traction, ouverture sur le devant, assemblage par clips, coloris selon arrivage. La hauteur indiqu&eacute;e est avec les roulettes.<br />\r\n<br />\r\n&bull; PVC rigide<br />\r\n&bull; Roulettes et poign&eacute;e de traction<br />\r\n&bull; Ouverture sur le devant<br />\r\n&bull; Coloris al&eacute;atoire bleu, rose ou marron selon arrivage</p>\', \'imac-caisse-de-transport-kim-60-avec-roulettes-pour-chien-l.jpeg\', 40, \'imac-caisse-de-transport-kim-60-avec-roulettes-pour-chien-l\', \'Imac\', \'Gris, Noir\', NULL, \'60x40x43 cm\'),
                            (93, 8, \'Trixie - Trolley de Transport sur Roulettes pour Chien et Chat\', \'<p>Trolley en polyester, confortable &agrave; porter en sac &agrave; dos gr&acirc;ce au matelassage. Pr&eacute;sence de rangements pratiques pour bouteille d&#39;eau, friandises. Convient pour chien et chat ne d&eacute;passant pas&nbsp;8 kilos.</p>\', \'trixie-trolley-de-transport-sur-roulettes-pour-chien-et-chat.jpeg\', 60, \'trixie-trolley-de-transport-sur-roulettes-pour-chien-et-chat\', \'Trixie\', \'Noir\', \'Tissu\', \'27x33x47 cm\'),
                            (94, 8, \'Europet Bernina - Sac de Transport en Nylon pour Chiens et Chats - M\', \'<p>Sac de transport en nylon, l&eacute;ger et pratique. Avec poign&eacute;e de transport, bandouli&egrave;re amovible, &eacute;tiquette d&#39;adresse et poche lat&eacute;rale. Ouverture par le haut et par un petit passage lat&eacute;ral. Dimensions de la taille M : 55x30x30 centim&egrave;tres.</p>\', \'europet-bernina-sac-de-transport-en-nylon-pour-chiens-et-chats-m.jpeg\', 35, \'europet-bernina-sac-de-transport-en-nylon-pour-chiens-et-chats-m\', \'Europet Bernina\', \'Noir\', \'Nylon\', \'54x27x4 cm\'),
                            (95, 44, \'Mélange de Graines pour Oiseaux de Jardins\', \'<p>Enrichi en granul&eacute;s de graisse arachide, les graines qui composent ce m&eacute;lange sont issus d&#39;une s&eacute;lection rigoureuse. Un m&eacute;lange pr&ecirc;t &agrave; l&#39;emploi, riche et complet, qui ne n&eacute;cessite aucun apport suppl&eacute;mentaire.<br />\r\n<br />\r\n<strong>Fabriqu&eacute; en France - &Agrave; conserver dans un endroit frais et sec.</strong></p>\', \'melange-de-graines-pour-oiseaux-de-jardins-e50de898a8.jpeg\', 19, \'melange-de-graines-pour-oiseaux-de-jardins\', \'Animalis\', NULL, NULL, \'10x43x64 cm\'),
                            (96, 44, \'Boules de Graisse pour Oiseaux des Jardins\', \'<p>Les boules de graisse Animalis sont issues d&#39;une s&eacute;lection rigoureuse et prennent en compte les besoins des oiseaux du jardin. Elles sont riches en prot&eacute;ines et graisses et sont une source d&#39;alimentation indispensable pour tous les oiseaux.<br />\r\n<br />\r\n<strong>Fabriqu&eacute; en France - &Agrave; conserver dans un endroit frais et sec.</strong></p>\', \'boules-de-graisse-pour-oiseaux-des-jardins-116598dd82.jpeg\', 11, \'boules-de-graisse-pour-oiseaux-des-jardins\', \'Animalis\', NULL, NULL, \'22x22x21 cm\'),
                            (97, 44, \'Cacahuètes pour Oiseaux des Jardins\', \'<p>L&#39;arachide attirera dans votre jardin toutes les esp&egrave;ces d&#39;oiseaux et les aideront &agrave; passer cette p&eacute;riode de froid difficile.<br />\r\n<br />\r\n<strong>Fabriqu&eacute; en France - &Agrave; conserver dans un endroit frais et sec.</strong></p>\', \'cacahuetes-pour-oiseaux-des-jardins-c4a601d2ee.jpeg\', 7, \'cacahuetes-pour-oiseaux-des-jardins\', \'Animalis\', NULL, \'1 Kg\', \'15x20x6 cm\'),
                            (98, 44, \'Tournesol Strié pour Oiseaux des Jardins\', \'<p>La graine de tournesol est une graine tr&egrave;s nutritive que l&#39;on peut offrir aux oiseaux. Elle est riche en huile et apporte les &eacute;l&eacute;ments essentiels &agrave; plusieurs esp&egrave;ces d&#39;oiseaux sauvages.<br />\r\n<br />\r\n<strong>Fabriqu&eacute; en France - &Agrave; conserver dans un endroit frais et sec.</strong></p>\', \'tournesol-strie-pour-oiseaux-des-jardins-4a89f18f82.jpeg\', 26, \'tournesol-strie-pour-oiseaux-des-jardins\', \'Animalis\', NULL, \'8 Kg\', \'40x70x10 cm\'),
                            (99, 44, \'Nourriture aux Vers de Terre pour Oiseaux du Ciel\', \'<p>Cylindre de graisse VEGETALE ma&iuml;s, cacahu&egrave;tes grill&eacute;es, huile v&eacute;g&eacute;tale (huile de tournesol et de ma&iuml;s / nous ne pouvons pas certifier qu&rsquo;elle ne soit pas faite sans OGM / Cette huile v&eacute;g&eacute;tale n&rsquo;est pas faite &agrave; base d&rsquo;huile de palme) avoine, insectes d&eacute;shydrat&eacute;s.<br />\r\nNe fond pas. 100 % consomm&eacute;.<br />\r\nAussi simple &agrave; installer que de compter jusque 3 : 1- retirer le film plastique ; 2- d&eacute;rouler la cordelette ; 3- suspendre et observer.<br />\r\nPeut se placer (sans son support) dans une mangeoire pour boules de graisse.<br />\r\nTr&egrave;s haute app&eacute;tance : les oiseaux en raffolent car riche en prot&eacute;ines et mati&egrave;res grasses.&nbsp;<br />\r\nLes oiseaux picorent sur place -au lieu d&#39;emmener la nourriture au loin - ce qui permet de les observer plus longtemps.</p>\', \'nourriture-aux-vers-de-terre-pour-oiseaux-du-ciel-7c4dd0c2c2.jpeg\', 6, \'nourriture-aux-vers-de-terre-pour-oiseaux-du-ciel\', \'Nature Marke\', NULL, NULL, \'5x5x16 cm\'),
                            (100, 44, \'Boule de Graisse Géante pour Oiseaux des Jardins\', \'<p>Les boules de graisse Animalis sont issues d&#39;une s&eacute;lection rigoureuse et prennent en compte les besoins des oiseaux du jardin. Elles sont riches en prot&eacute;ines et graisses et sont une source d&#39;alimentation indispensable pour tous les oiseaux.<br />\r\n<br />\r\n<strong>Fabriqu&eacute; en France - &Agrave; conserver dans un endroit frais et sec.</strong></p>\', \'boule-de-graisse-geante-pour-oiseaux-des-jardins-756e4b187d.jpeg\', 2, \'boule-de-graisse-geante-pour-oiseaux-des-jardins\', \'Animalis\', NULL, \'540 g\', \'9x9x9 cm\'),
                            (101, 46, \'Mangeoire Le Duo des Graines pour Oiseaux du Ciel\', \'<p>Mangeoire 2 en 1 en c&egrave;dre rouge aromatique pour graisse, graines et m&eacute;langes.<br />\r\nContient soit des graines soit un cylindre de graisse.&nbsp;<br />\r\nEn fonction de la nourriture install&eacute;e, attirera principalement des oiseaux insectivores (pour la graisse) ou granivores (pour les graines).<br />\r\nLarge toit pour proteger la nourriture des intemp&eacute;ries.<br />\r\nToit amovible pour remplissage ais&eacute;.<br />\r\nTube en polycarbonate : haute r&eacute;sistance aux UV et au gel.<br />\r\nTube amovible pour transformation et nettoyage facile et r&eacute;gulier de la mangeoire.<br />\r\nLeg&egrave;re ouverture dans le bas du tube pour permettre un &eacute;coulement r&eacute;gulier des graines.<br />\r\nVis et tige filet&eacute;e en acier<br />\r\nA suspendre ou placer sur un poteau.</p>\', \'mangeoire-le-duo-des-graines-pour-oiseaux-du-ciel-7139678389.jpeg\', 26, \'mangeoire-le-duo-des-graines-pour-oiseaux-du-ciel\', \'Nature Marke\', \'Boisé\', \'Bois\', \'21x21.5x27 cm\'),
                            (102, 46, \'Mangeoire Petite Fleur pour Oiseaux du Ciel\', \'<p>Mangeoire en c&egrave;dre rouge aromatique pour graines et m&eacute;langes.<br />\r\nAttirera principalement des oiseaux granivores ou omnivores : moineaux, verdiers, sittelles et m&eacute;sanges.<br />\r\nLarge toit pour proteger la nourriture des intemp&eacute;ries.<br />\r\nToit amovible pour remplissage ais&eacute;.<br />\r\nVitres en polycarbonate : haute r&eacute;sistance aux UV et au gel.<br />\r\nNettoyage facile et r&eacute;gulier de la mangeoire.<br />\r\nLeg&egrave;re ouverture dans le bas de la mangeoire pour permettre un &eacute;coulement r&eacute;gulier des graines.<br />\r\nCordelette en acier recouvert de plastique pour protection antirouille.<br />\r\nA suspendre ou placer sur un poteau.</p>\', \'mangeoire-petite-fleur-pour-oiseaux-du-ciel-cdb440a550.jpeg\', 30, \'mangeoire-petite-fleur-pour-oiseaux-du-ciel\', \'Nature Marke\', \'Boisé\', \'Bois\', \'18x18x31 cm\'),
                            (103, 46, \'Graines de Découvertes - Refuge : Hôtel à Insectes\', \'<p>L&#39;h&ocirc;tel &agrave; insectes est un v&eacute;ritable refuge pour les insectes. Il est esth&eacute;tique, &eacute;cologique et surtout tr&egrave;s utile pour les insectes. Il a &eacute;t&eacute; pens&eacute; par le designer Olivier Toulouse, ce kit est 100% li&egrave;ge recycl&eacute; et il permettra aux enfants et &agrave; leurs parents d&rsquo;approcher au plus pr&egrave;s le monde des insectes.<br />\r\n<br />\r\nEnsemble, ils pourront apprendre &agrave; reconna&icirc;tre les pollinisateurs (abeilles solitaires, bourdons, papillons) et les pr&eacute;dateurs (chrysopes, gu&ecirc;pes solitaires, coccinelles). Avec cet &eacute;veil au moyen du jeu, les enfants int&eacute;greront et d&eacute;velopperont tr&egrave;s t&ocirc;t des attitudes &eacute;co-responsables.<br />\r\n<br />\r\n<strong>Contenu de l&#39;h&ocirc;tel des insectes :</strong></p>\r\n\r\n<ul>\r\n	<li>1 h&ocirc;tel &agrave; insectes &agrave; monter en 9 pi&egrave;ces (&eacute;corce de li&egrave;ge et bois de pin)</li>\r\n	<li>1 livret &eacute;ducatif</li>\r\n	<br />\r\n	<li><strong>Conseils de l&#39;h&ocirc;tel des insectes :</strong></li>\r\n	<li>Pour les enfants &agrave; partir de 6 ans</li>\r\n	<li>Installer dans un endroit abrit&eacute; des intemp&eacute;ries, contre un mur ou un arbre au calme, il doit se situer &agrave; proximit&eacute; d&rsquo;un parterre de fleurs sauvages ou cultiv&eacute;es</li>\r\n	<br />\r\n	<li>Ce coffret a &eacute;t&eacute; con&ccedil;u en collaboration avec Micropolis, la cit&eacute; des insectes.</li>\r\n</ul>\', \'graines-de-decouvertes-refuge-hotel-a-insectes-809f810c30.jpeg\', 19, \'graines-de-decouvertes-refuge-hotel-a-insectes\', \'Gasco\', NULL, NULL, NULL),
                            (104, 46, \'Abreuvoir au Bain pour Oiseaux du Ciel\', \'<p>L&#39;abreuvoir permet &agrave; l&#39;oiseau de se rafraichir, de s&#39;hydrater et de se d&eacute;barasser de parasites.</p>\', \'abreuvoir-au-bain-pour-oiseaux-du-ciel-809b134b90.jpeg\', 35, \'abreuvoir-au-bain-pour-oiseaux-du-ciel\', \'Nature Marke\', \'Gris\', \'Acier\', \'29.5x29.5x14 cm\'),
                            (105, 46, \'Mangeoire Restaurant pour Oiseaux du Ciel\', \'<p>Mangeoire MURALE en c&egrave;dre rouge aromatique pour graisses, cacahu&egrave;tes, graines ou m&eacute;langes.<br />\r\n3 postes de nourrissage pour une multitude d&#39;oiseaux : rouge-gorges, moineaux, verdiers, sittelles et m&eacute;sanges.<br />\r\nLarge toit pour proteger la nourriture des intemp&eacute;ries.<br />\r\nToit amovible pour remplissage ais&eacute;.<br />\r\nVitre en plexyglass : haute r&eacute;sistance aux UV et au gel.<br />\r\nVitre amovible pour nettoyage facile et r&eacute;gulier de la mangeoire.<br />\r\nLeg&egrave;re ouverture dans le bas du plexy pour permettre un &eacute;coulement r&eacute;gulier des graines.<br />\r\nA accrocher sur un mur, un tronc ou un poteau.</p>\', \'mangeoire-restaurant-pour-oiseaux-du-ciel-af257b4565.jpeg\', 33, \'mangeoire-restaurant-pour-oiseaux-du-ciel\', \'Nature Marke\', \'Boisé\', \'Bois\', \'37.5x17.5x29.5 cm\'),
                            (106, 46, \'Mangeoire Buffet pour Oiseaux du Ciel\', \'<p>Mangeoire en c&egrave;dre rouge aromatique,<br />\r\nA placer sur une fen&ecirc;tre,<br />\r\nLarge toit transparent en plexyglass.<br />\r\nLe plexyglass ne jaunit pas avec le temps et r&eacute;siste au gel et aux UV<br />\r\nSupport transparent = id&eacute;al pour admirer les oiseaux depuis l&#39;int&eacute;rieur de la maison&nbsp;<br />\r\nSupport transparent = prot&egrave;ge la vitre des salissures et les graines des intemp&eacute;ries<br />\r\n2 postes de nourrissages : 2 bloc de graisse, m&eacute;lange de graines,<br />\r\nLivr&eacute;e avec 3 ventouses en caoutchouc avec languette : resiste au gel, d&eacute;collage ais&eacute;, supporte jusqu&#39;&agrave; 2 kg,</p>\', \'mangeoire-buffet-pour-oiseaux-du-ciel-9b9f2339db.jpeg\', 29, \'mangeoire-buffet-pour-oiseaux-du-ciel\', \'Nature Marke\', \'Boisé\', \'Bois\', \'25x16x15 cm\'),
                            (107, 46, \'Mangeoire Café de la Gare pour Oiseaux du Ciel\', \'<p>Mangeoire en pin peinte pour graines et m&eacute;langes.<br />\r\nVitres amovibles en PVC pour nettoyage ais&eacute; de la mangeoire<br />\r\nLarge toit pour proteger la nourriture des intemp&eacute;ries.<br />\r\nToit amovible pour remplissage ais&eacute;.<br />\r\nLeg&egrave;re ouverture dans le bas du plexy pour permettre un &eacute;coulement r&eacute;gulier des graines.<br />\r\nCordelette pour suspension.<br />\r\nA suspendre ou placer sur un poteau</p>\', \'mangeoire-cafe-de-la-gare-pour-oiseaux-du-ciel-b8922130f8.jpeg\', 16, \'mangeoire-cafe-de-la-gare-pour-oiseaux-du-ciel\', \'Nature Marke\', \'Marron, Vert\', \'Bois\', \'19x19x19 cm\'),
                            (108, 46, \'Mangeoire Urban pour Oiseaux\', \'<p>La s&eacute;rie Urban de Wildlife World est une collection d&#39;&eacute;l&eacute;ments contemporains qui place l&#39;habitat des animaux sauvages dans des milieux urbains. Pour s&#39;adapter &agrave; la vie citadine, le design est minimaliste et fonctionnel.</p>\r\n\r\n<p>Le design sobre du nichoir est tant &eacute;l&eacute;gant que pratique. L&#39;avant de la petite maison peut &ecirc;tre relev&eacute; pour sortir la bo&icirc;te int&eacute;rieure et la nettoyer si besoin. L&#39;ouverture ronde du nichoir est prot&eacute;g&eacute;e par un anneau de 32 mm en acier inoxydable.</p>\', \'mangeoire-urban-pour-oiseaux-960dfd2dbc.jpeg\', 32, \'mangeoire-urban-pour-oiseaux\', \'Wildlife\', \'Boisé, Blanc\', NULL, \'15.5x16x16 cm\'),
                            (109, 46, \'Mangeoire Chandelle pour Oiseaux du Ciel\', \'<p>Mangeoire en m&eacute;tal pour cylindre de graisse,&nbsp;<br />\r\nAvec oiseau en 3D<br />\r\nAussi facile a remplir que de compter jusque 3 : serrer l&#39;arceau et l&rsquo; incliner / placer le cylindre de graisse / Replacer l&rsquo;arceau en position<br />\r\nPermet d&#39;attirer surtout des oiseaux insectivores (rouge gorges, etc&hellip;.) et omnivores (m&eacute;sanges, etc&hellip;.)<br />\r\nA suspendre&nbsp;</p>\', \'mangeoire-chandelle-pour-oiseaux-du-ciel-7f2dd15e40.jpeg\', 16, \'mangeoire-chandelle-pour-oiseaux-du-ciel\', \'Nature Marke\', \'Noir\', \'Acier\', \'13x13x34 cm\'),
                            (110, 45, \'Nichoir Dodu pour Oiseaux du Ciel\', \'<p>Le nichoir permet &agrave; l&rsquo;oiseau de se prot&eacute;ger des intemp&eacute;ries et du mauvais temps mais surtout de se reproduire en toute s&eacute;curit&eacute;, &agrave; l&rsquo;abri des pr&eacute;dateurs, au printemps<br />\r\nLarge ouverture du nichoir sp&eacute;cialement adapt&eacute;e -en outre- aux rouge-gorges<br />\r\nLe nichoir doit &ecirc;tre nettoy&eacute; en automne apr&egrave;s les nich&eacute;es du printemps<br />\r\nA accrocher sur un arbre<br />\r\nMode d&rsquo;emploi et informations au dos de l&rsquo;&eacute;tiquette</p>\', \'nichoir-dodu-pour-oiseaux-du-ciel-6fa9adba4e.jpeg\', 26, \'nichoir-dodu-pour-oiseaux-du-ciel\', \'Nature Marke\', \'Boisé\', \'Bois\', \'25x17x20 cm\'),
                            (111, 45, \'Nichoir Le Refuge pour Oiseaux du Ciel\', \'<p>Nichoir fabriqu&eacute;e en FRANCE &agrave; partir de pin Douglas, certifi&eacute; PEFC Attirera principalement des oiseaux de petite taille : Rouge gorge.</p>\', \'nichoir-le-refuge-pour-oiseaux-du-ciel-28fea7e65f.jpeg\', 30, \'nichoir-le-refuge-pour-oiseaux-du-ciel\', \'Animalis\', \'Boisé\', \'Bois\', \'16x21x30 cm\'),
                            (112, 45, \'Nichoir Fleur pour Oiseaux du Ciel\', \'<p>Nichoir fabriqu&eacute;e en FRANCE &agrave; partir de pin Douglas, certifi&eacute; PEFC Attirera principalement des oiseaux de petite taille : Verdiers et m&eacute;sanges.</p>\', \'nichoir-fleur-pour-oiseaux-du-ciel-e50a2691b8.jpeg\', 30, \'nichoir-fleur-pour-oiseaux-du-ciel\', \'Animalis\', \'Boisé\', \'Bois\', \'13x13x25 cm\'),
                            (113, 45, \'Nid Coton\', \'<p>Coton 100% naturel pour tous les oiseaux des jardins.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<ul>\r\n	<li>Coton naturel</li>\r\n	<li>Doux et confortable</li>\r\n</ul>\', \'nid-coton-0b6749655a.jpeg\', 6, \'nid-coton\', \'Animalis Nature\', NULL, \'100 g\', NULL),
                            (114, 45, \'Nichoir pour oiseaux du ciel\', \'<p>Nichoir pour oiseaux du ciel</p>\', \'nichoir-pour-oiseaux-du-ciel-9e3b60cd29.jpeg\', 26, \'nichoir-pour-oiseaux-du-ciel\', \'Nature Marke\', \'Boisé\', \'Bois\', \'19x16x25 cm\'),
                            (115, 45, \'Hôtel Urban pour Insectes\', \'<p>La s&eacute;rie Urban de Wildlife World est une collection d&#39;&eacute;l&eacute;ments contemporains qui place l&#39;habitat des animaux sauvages dans des milieux urbains. Pour s&#39;adapter &agrave; la vie citadine, le design est minimaliste et fonctionnel.<br />\r\n<br />\r\nAvec cet h&ocirc;tel &agrave; insectes Urban, vous offrez aux insectes un abri conforme &agrave; leurs besoins. Les fentes et les compartiments situ&eacute;s &agrave; l&#39;int&eacute;rieur sont parfaitement adapt&eacute;s &agrave; la taille des cafards, papillons, araign&eacute;es et autres insectes ; ces derniers peuvent ainsi faire leur nid et passer l&#39;hiver bien au chaud dans cette bo&icirc;te. Par ailleurs, les cavit&eacute;s peuvent &ecirc;tre personnalis&eacute;es avec des &eacute;corces, des petites branches ou feuilles et attirer ainsi des insectes particuliers. Chaque sorte d&#39;insecte a ses avantages. C&#39;est ainsi que les araign&eacute;es &eacute;loignent moucherons et autres mouches en &eacute;t&eacute; de la maison ou que les coccinelles combattent les pucerons des fleurs et des plantes.</p>\', \'hotel-urban-pour-insectes-4ebfe12f71.jpeg\', 32, \'hotel-urban-pour-insectes\', \'Wildlife\', \'Boisé, Blanc\', \'Bois\', NULL),
                            (116, 33, \'Mélange de Graines pour Perroquet\', \'<p>Ce m&eacute;lange paradisio, con&ccedil;u sp&eacute;cialement pour les perroquets, est un met d&eacute;licieux qui rassemble des graines les plus savoureuses, tournesol, gruau d&#39;avoine, bananes s&eacute;ch&eacute;es, pour ne citer que leurs pr&eacute;f&eacute;r&eacute;es.</p>\', \'melange-de-graines-pour-perroquet-18b205bdcd.jpeg\', 11, \'melange-de-graines-pour-perroquet\', \'Paradisio\', NULL, \'2.4 Kg\', NULL),
                            (117, 33, \'Kräcker Abricot Figue pour Perruches\', \'<p>Friandises croustillantes riches en abricot et en figue et sp&eacute;cialement adapt&eacute;es aux besoins des perruches.Fruit d&rsquo;un savoir-faire in&eacute;gal&eacute; et d&rsquo;un proc&eacute;d&eacute; de fabrication unique, chaque baguette est cuite trois fois sur un b&acirc;ton de bois pouvant &ecirc;tre picor&eacute;. Les Kr&auml;ckers permettent &agrave; la fois de maintenir les oiseaux en bonne sant&eacute; et de lutter contre l&rsquo;inactivit&eacute;.</p>\', \'kracker-abricot-figue-pour-perruches-8342ec1dcb.jpeg\', 2, \'kracker-abricot-figue-pour-perruches\', \'Vitakraft\', NULL, NULL, \'2.5x6.1x19.7 cm\'),
                            (118, 33, \'Friandises Crunchy Stick Groseille et Sorbier pour Grandes Perruches\', \'<p>Fabriqu&eacute;es &agrave; partir d&#39;ingr&eacute;dients naturels et vitaminiques, les baguettes Crunchy Sticks ont &eacute;t&eacute; sp&eacute;cialement con&ccedil;ues pour l&#39;alimentation compl&eacute;mentaire des oiseaux domestiques. Elabor&eacute;es selon des recettes destin&eacute;es &agrave; combler les besoins sp&eacute;cifiques de chaque esp&egrave;ce, elles sont enrichies de 2 ingr&eacute;dients &quot;plaisir&quot;. Saines, elles sont garanties sans colorants, sans conservateurs et sans sucres ajout&eacute;s, et favorisent naturellement l&#39;entretien du bec. Elles sont enveloppp&eacute;es dans un sachet fra&icirc;cheur qui pr&eacute;serve leur qualit&eacute; tout en les prot&eacute;geant des insectes. Chaque pack contient deux baguettes &eacute;quip&eacute;es d&#39;un crochet en plastique pour &ecirc;tre facilement suspendues &agrave; la cage de l&#39;animal.</p>\', \'friandises-crunchy-stick-groseille-et-sorbier-pour-grandes-perruches-afac057854.jpeg\', 5, \'friandises-crunchy-stick-groseille-et-sorbier-pour-grandes-perruches\', \'Zolux\', NULL, \'115 g\', \'6.7x2.7x20 cm\'),
                            (119, 33, \'Millet Jaune en Grappe pour Oiseau\', \'<p>Compl&eacute;ment alimentaire 100% d&#39;origine naturel &agrave; suspendre dans la cage pour tous les oiseaux.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<ul>\r\n	<li>&Eacute;vite l&#39;ennui</li>\r\n	<li>Maintient la forme</li>\r\n</ul>\', \'millet-jaune-en-grappe-pour-oiseau-4b3b4446cb.jpeg\', 9, \'millet-jaune-en-grappe-pour-oiseau\', \'Animalis Nature\', NULL, \'1 Kg\', NULL),
                            (120, 33, \'Pâtée Fortifiante Fruits pour Oiseaux\', \'<p>En compl&eacute;ment ponctuel de la ration quotidienne de graines. P&acirc;t&eacute;e saveur fruits pour oiseaux domestiques est indispensable en phase critique de ponte, croissance et mue.</p>\r\n\r\n<p>Bo&icirc;te en carton avec sachet fra&icirc;cheur azot&eacute; transparent &eacute;vitant l&#39;intusion des insectes et pr&eacute;servant la qualit&eacute; et la fra&icirc;cheur des ingr&eacute;dients</p>\', \'patee-fortifiante-fruits-pour-oiseaux-9ead9bcbff.jpeg\', 4, \'patee-fortifiante-fruits-pour-oiseaux\', \'Animalis\', NULL, \'150 g\', \'4x11.6x18.3 cm\'),
                            (121, 33, \'Mélange de Graines pour Pigeon 4 Saisons\', \'<p>Le Pigeon Basse Cour GASCO est un m&eacute;lange de c&eacute;r&eacute;ales complet et &eacute;quilibr&eacute;, enrichi en prot&eacute;agineux, con&ccedil;u sp&eacute;cialement pour l&#39;alimentation des pigeons &agrave; toutes saisons.</p>\', \'melange-de-graines-pour-pigeon-4-saisons-718a9252c1.jpeg\', 10, \'melange-de-graines-pour-pigeon-4-saisons\', \'Gasco\', NULL, NULL, NULL),
                            (122, 5, \'Mélange de Graines pour Oiseaux Exotiques\', \'<p>Gr&acirc;ce &agrave; l&#39;ouverture facile de ce sachet fra&icirc;cheur, vous conserverez ais&eacute;ment la qualit&eacute; gustative des graines. Ce m&eacute;lange paradisio pour oiseaux exotiques convient en alimentation principale</p>\', \'melange-de-graines-pour-oiseaux-exotiques-a4879f88fd.jpeg\', 11, \'melange-de-graines-pour-oiseaux-exotiques\', \'Paradisio\', NULL, \'3 Kg\', NULL),
                            (123, 33, \'Bloc de Sel pour Canaris\', \'<p>Ce bloc de sel picosel a &eacute;t&eacute; &eacute;tudi&eacute; sp&eacute;cialement pour offrir tous les min&eacute;raux essentiels &agrave; l&#39;alimentation de votre canari qui se r&eacute;galera sans aucun doute.</p>\', \'bloc-de-sel-pour-canaris-652fa6d6bd.jpeg\', 2, \'bloc-de-sel-pour-canaris\', \'Picosel\', NULL, NULL, NULL),
                            (124, 5, \'Mélange de Graines pour Padda de Java\', \'<p>Animalis a s&eacute;lectionn&eacute; pour vous une gamme d&#39;aliments pour oiseaux de haute qualit&eacute; sans colorants et ar&ocirc;mes artificiels. Donner les M&eacute;langes complets Animalis &agrave; votre oiseau, c&#39;est la garantie de lui donner un produit compos&eacute; d&#39;une grande vari&eacute;t&eacute; de composants pour son plus grand plaisir et de r&eacute;pondre pleinement aux besoins de son esp&egrave;ce.</p>\r\n\r\n<p>Les M&eacute;langes complets pour oiseaux Animalis sont conditionn&eacute;s sous atmosph&egrave;re protectrice et contr&ocirc;l&eacute;e, garantissant la pr&eacute;servation des vitamines et la fraicheur du produit.</p>\r\n\r\n<p><strong>Caract&eacute;ristiques :</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<ul>\r\n	<li>Recette riche en ingr&eacute;dients</li>\r\n	<li>Riche en Riz Paddy</li>\r\n	<li>Vers de farine</li>\r\n</ul>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Produit fabriqu&eacute; en Union Europ&eacute;enne (Belgique).</strong></p>\r\n\r\n<p><strong>Pr&eacute;cautions :</strong></p>\r\n\r\n<p>Nourriture destin&eacute;e aux animaux. Conserver dans un endroit frais, sec et &agrave; l&#39;abri de la lumi&egrave;re. Ne pas laisser &agrave; la port&eacute;e des enfants.</p>\', \'melange-de-graines-pour-padda-de-java-4cf35e4ae0.jpeg\', 7, \'melange-de-graines-pour-padda-de-java\', \'Animalis\', NULL, \'1 Kg\', NULL),
                            (125, 34, \'Cage Rekord 2 Blanche pour Canaris et Petits Oiseaux Exotiques\', \'<p>Rekord 2 est une cage avec une base rectangulaire, id&eacute;ale pour canaris, oiseaux exotiques et autres petits oiseaux. Elle a une poign&eacute;e pour un transport facile et elle est faite de grillage m&eacute;tallique peint en blanc et a une base en plastique robuste. Cette cage est livr&eacute;e de tous les accessoires indispensables : abreuvoir, perchoirs, mangeoires pivotantes extractibles Brava 1, une balan&ccedil;oire, une pince et un godet. Cette cage est facile &agrave; entretenir et se nettoie rapidement gr&acirc;ce &agrave; son bac (coloris al&eacute;atoires) et son tiroir amovibles. Lorsque cela est n&eacute;cessaire, vous pouvez enlever compl&egrave;tement la base gr&acirc;ce aux crochets sur les c&ocirc;t&eacute;s.</p>\', \'cage-rekord-2-blanche-pour-canaris-et-petits-oiseaux-exotiques-79956b2d7a.jpeg\', 30, \'cage-rekord-2-blanche-pour-canaris-et-petits-oiseaux-exotiques\', \'Ferplast\', \'Violet\', \'Plastique, Fer\', \'25x39x41 cm\'),
                            (126, 34, \'Cage Rekord 3 pour Oiseaux Exotiques\', \'<p>La cage Rekord 2 Colors est un havre de paix et de bien-&ecirc;tre pour vos cr&eacute;atures &agrave; bec et &agrave; plumes. En fer blanc, pour une atmosph&egrave;re zen et un bac en plastique bleu ; cette cage est tout &eacute;quip&eacute;e pour faire chanter de plaisir vos oiseaux. Dot&eacute;e de deux mangeoires, de deux perchoirs, d&#39;une balan&ccedil;oire, d&#39;un godet &agrave; miel et d&#39;une pince ; elle leur offrira tout le confort n&eacute;cessaire.</p>\', \'cage-rekord-3-pour-oiseaux-exotiques-8757615deb.jpeg\', 60, \'cage-rekord-3-pour-oiseaux-exotiques\', \'Ferplast\', \'Bleu\', \'Plastique, Fer\', \'49x30x48.5 cm\')');
